INSERT INTO `companies` (`company_id`, `company_city`, `company_state`, `company_country`, `company_email`, `company_phone`, `company_screenname`, `company_tagname`, `company_logo`, `company_startdate`, `company_enddate`, `company_telecommuting`, `company_bio`, `company_status`, `user_website`, `user_fburl`, `user_linkdinurl`, `user_googleurl`, `company_myrole`) VALUES
(1, 'San Francisco', 'California', 'USA', 'eli@taylormadetraffic.com', '14153000834', 'Taylor Made Traffic', 'TaylorMadeTraffic', '/wwwroot/images/TMM_Logo_flat.png', NULL, NULL, 1, '<p>Eli founded Taylor Made Management in 2002 to produce a public music &amp; arts festival called <a href=\'/projects?pid=7\' target=\'_blank\'>Traffic</a>. This URL was the <a href=\'http://traffic.taylormadetraffic.com/traffic.html\' target=\'_blank\'>website</a>. Today it is a portfolio of the projects he has been blessed to be part of and the many <a href=\"/team\">people</a> who have contributed.</p>\n<p>This page features the products and brands directly from TaylorMadeTraffic. We are seeking like-minded visionaries that know how to develop, design or sell. If that\'s you, please reach out: <span class=\'alink\'>tmt@taylormadetraffic.com</span></p>\n<p>If you have your own product that you are passionate about, and feel we might be of service, please do the same or use the filters above to find similar work experiences by <a href=\'/technologies\'>technology</a> or <a href=\'/industries\'>industry</a></p>', 2, 'http://TaylorMadeTraffic.com', NULL, NULL, NULL, 'Owner & Engineer'),
(2, 'San Francisco', 'California', 'USA', 'eli@taylormadetraffic.com', '14153000834', 'TaylorMade Product Deck', 'TaylorMadeManagement', '/wwwroot/images/TMM_Logo_flat.png', NULL, NULL, 1, '<p>I am searching for the perfect international team to share these vision and expand the business. If you are interested in a product from one of these short summaries, please request the complete media kit and business plan. Each has a much more in-depth analysis of the target market, industry competitors, technical hurdles, and profitable opportunities.</p>', 2, 'http://TaylorMadeTraffic.com', NULL, NULL, NULL, 'Owner & Engineer'),
(3, 'San Francisco', 'California', 'USA', 'eli@healthline.com', '4152813144', 'Healthline Networks', 'Healthline Networks', '/wwwroot/images/hl-logo-v1-20160628090908.png', NULL, NULL, 0, 'Healthline is a medical search engine focused on indexing and searching large volumes of medical data. Surrounding their extremely well maintained taxonomy are several core products including Symptom Search, Doc Search, and Pill Finder', 1, 'www.healthline.com', NULL, NULL, NULL, 'UI Engineer'),
(4, 'Bogotá', 'Cundinamarca', 'Colombia', 'eli@idinteractive', '+57 310-558-4048', 'ID Interactive', 'ID Interactive', '/wwwroot/images/interactive-logo.png', NULL, NULL, 0, 'Interactive builds marketing platforms for a long list of great clients with creative projects and campaigns. ', 1, 'idinteractive.com', NULL, NULL, NULL, 'Senior Web Developer'),
(5, 'Santa Barbara', 'California', 'USA', '', '', 'Noospheric LLC', 'Noospheric LLC', 'wwwroot/images/noospheric-logo-sm.png', NULL, NULL, 1, NULL, 1, 'http://www.noospheric.com/', NULL, NULL, NULL, 'Web Developer'),
(7, 'Denver', 'Colorado', 'USA', 'info@tripchi.com', '', 'tripchi', 'tripchi', '/wwwroot/images/tripchi.png', NULL, NULL, 1, 'The tripchi airport app recommends things to do in the airport based on your interests, flight details, &amp; location. It also provides a network for users to share rides into town and find things to do during long-layovers.', 1, 'tripchi.com', NULL, NULL, NULL, 'Architect & UI Engineer'),
(8, 'San Francisco', 'California', 'USA', 'info@trackauthoritymusic.com', '4153000834', 'Track Authority Music', 'Track Authority Music', '/wwwroot/images/taLogo.png', NULL, NULL, 1, '<p>This is a platform for building competitive and rewarding games around music. Each of the four current games has slightly different rules and timelines for turning Challenges into Playlists into Compilations.</p><p>Across all games, each “Challenge” (playlist theme) must have at least one award and winner. Most games are free to enter, and awards are sponsored by members or advertising companies. The primary money making group will likely be “Fantasy Track Ball” where it costs ~$5 to enter a track and the award is ~80% of the pool. Yes, betting on your own musical tastes to a theme. Currently, of the four games, only this one is open to public registration. Please request an invitation for the other games.</p>', 1, 'trackauthoritymusic.com', NULL, NULL, NULL, 'Architect & UI Engineer'),
