(304, 'ema platform for high school newspapers that allows students to collaborate and share their academic and athletic achievementsem                pstudents and teachers would be able to develop assignments work on multiple versions of a story share ideas within the class and morep                            pthe competitive advantage of this site is in the versioncontrolling system that allows peerreviews teachers edit and the students versions to all be tracked independently in addition the system would include tools for simplifying footnotes and sources and to include photos and linksp', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 89, '/deck', 'taylormadetraffic.com', '<em>Es una plataforma para periódicos escolares que permite a los estudiantes colaborar y compartir sus logros académicos y deportivos.</em>\n\n<p>Los estudiantes y los profesores podrán desarrollar tareas, escribir  historias con múltiplex versiones y compartir ideas dentro de la clase, entre otras cosas.</p>            \n\n<p>La ventaja competitiva de este sitio se encuentra en el sistema que permite recibir comentarios y correcciones  de los profesores  hacia los estudiantes, quienes podrán revisarlos de manera independiente. Además, los profesores podrán escribir comentarios y calificar los reportes con un iPad y lápiz</p>', '<em>A platform for High School newspapers that allows students to collaborate and share their academic and athletic achievements.</em>\n\n<p>Students and teachers will be able to develop assignments, work on multiple versions of a story, share ideas within the class, and more.</p>            \n\n<p>The competitive advantage of this site is in the version-controlling system that allows peer-reviews, teachers\' edits, and the students\' versions to all be tracked independently. Teachers will be able to markup and grade student essays with a iPad and stylus by writing on the screen</p>', 'en', 'live', NULL, 1390449593, '2014-01-23 17:50:26'),
