(307, 'ul classmarketresearch                            liacross the united states there are 26407 public secondary schools and 10693 private secondary schools 2001  a hrefhttpwww2edgovaboutofficeslistovaepihshsfactshtml targetblanksourceali                            lithe total 1999 fall enrollment in public secondary schools grades 912 was slightly over 13369000 students 2001  a hrefhttpwww2edgovaboutofficeslistovaepihshsfactshtml targetblanksourceali                            lithere are 8262 secondary schools in colombia 2001  a hrefhttpwwwbdigitalunaleduco36671515indicadoresdegestic3b3nlosindicadoresdelalc3adneaobjetivo04dpdf targetblanksourceali                        ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 115, '/deck', 'taylormadetraffic.com', '<ul class=\'marketresearch\'>\n                            <li>En todo Estados Unidos hay 26.407 escuelas secundarias públicas y 10.693 escuelas secundarias privadas (2001) - <a href=\"http://www2.ed.gov/about/offices/list/ovae/pi/hs/hsfacts.html\" target=\"_blank\">source</a></li>\n                            <li>La matrícula total en 1999 en las escuelas secundarias públicas (grados 9-12) fue de poco encima de 13,369,000 de estudiantes (2001) - <a href=\"http://www2.ed.gov/about/offices/list/ovae/pi/hs/hsfacts.html\" target=\"_blank\">source</a></li>\n                            <li>Hay 8,262 colegios en Colombia (2001) - <a href=\"http://www.bdigital.unal.edu.co/3667/15/15_Indicadores_de_Gesti%C3%B3n_los_indicadores_de_la_l%C3%ADnea_objetivo_04_D.PDF\" target=\"_blank\">source</a></li>\n                        </ul>', '<ul class=\'marketresearch\'>\n                            <li>Across the United States there are 26,407 public secondary schools and 10,693 private secondary schools (2001) - <a href=\"http://www2.ed.gov/about/offices/list/ovae/pi/hs/hsfacts.html\" target=\"_blank\">source</a></li>\n                            <li>The total 1999 fall enrollment in public secondary schools (grades 9-12) was slightly over 13,369,000 students (2001) - <a href=\"http://www2.ed.gov/about/offices/list/ovae/pi/hs/hsfacts.html\" target=\"_blank\">source</a></li>\n                            <li>There are 8,262 secondary schools in Colombia (2001) - <a href=\"http://www.bdigital.unal.edu.co/3667/15/15_Indicadores_de_Gesti%C3%B3n_los_indicadores_de_la_l%C3%ADnea_objetivo_04_D.PDF\" target=\"_blank\">source</a></li>\n                        </ul>', 'en', 'live', NULL, 1390449593, '2014-01-23 16:46:32'),
