(309, 'ul classdatelist                            li6 months in 2 schools with basic texteditor and version controllingli                            li1 year in schools with fullfeature texteditor and multiuser version controllingli                        ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 133, '/deck', 'taylormadetraffic.com', '                          <ul class=\'datelist\'>\n                            <li>6 meses: en 2 colegios con editor basico de texto y la versión controlar</li>\n                            <li>1 año: afinar editor y tener una herramienta para que los profesores para editar documentos con un lápiz en un iPad</li>\n                        </ul>', '<ul class=\'datelist\'>\n                            <li>6 months: in 2 schools with basic text-editor and version controlling</li>\n                            <li>1 year: fine tude the text-editor and have a tool for teachers to mark-up and grade student papers with a stylus in an iPad</li>\n                        </ul>', 'en', 'live', NULL, 1390449593, '2014-01-23 16:52:06'),
(310, 'eman online and mobile game for music lovers to play exchange and reward musical tasteem                    phighly rated users are rewarded with free music gift certificates concert tickets and cash from sponsors and partnersp                    pthe platform supports three ways to play and win each starts with a playlist theme such as rise and shine songs for my alarm clockp                    ul                        li1 group members enter a song that suits the themeli                        li2 group members list and rate each others songsli                        li3 after two weeks the person who submitted the highest rated song winsli                    ul                    pthis game can easily be incorporated as a promotional vehicle for concert tours for example if that alarm clock was jayzs the options are countless for prizes from tickets to backstage passes and all links during the competition promote the concertp', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 89, '/deck', 'taylormadetraffic.com', '<em>Es un juego en línea y para teléfonos móviles que permite a los amantes de la música poder reproducir e intercambiar canciones y obtener recompensas por su gusto musical.</em>\n\n<p>Los usuarios podrán ser calificados y quienes registren las más altas calificaciones serán premiados con música gratis, bonos de regalos, entradas para conciertos y  los más afortunados con dinero en efectivo. Todo esto auspiciado por los  patrocinadores y socios.</p>\n\n<p>La plataforma soporta tres formas de jugar y ganar. Cada una comienza con un tema de una lista de reproducción y las tres permiten promover artistas, vídeos de música y giras de conciertos.</p>', '<em>An online and mobile game for music lovers to play, exchange, and reward musical taste.</em>\n                    <p>Highly rated users are rewarded with free music, gift certificates, concert tickets and cash from sponsors and partners.</p>\n                    <p>The platform supports three ways to play and win. Each starts with a playlist theme, and all three have unique way to promote artists, music videos, and concert tours.</p>', 'en', 'live', NULL, 1390449593, '2014-01-23 19:59:05'),
(311, 'ul classalphalist                            liconcert ticket resales 35 feeli                            li1  10 subscriptions to adfree listening and extra playlist featuresli                            liconcert ticket promotions advertising and salesli                        ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 97, '/deck', 'taylormadetraffic.com', '<ul class=\'alphalist\'> \n<li> reventas de boletas para conciertos (tasa del 3-5%) </li> \n<li> $1 - $10 suscripciones sin publicidad y capacidad para personalizar listas de reproducciónes</ li> \n<li> Promover de conciertos independiente</li> \n<li> Intereses bancarios por tenencia de dinero en efectivo hasta después del evento</li>\n</ul>\n', '<ul class=\'alphalist\'>\n                            <li>concert ticket re-sales (3-5% fee)</li>\n                            <li>$1 - $10 subscriptions to ad-free listening and extra playlist features</li>\n                            <li>Concert ticket promotions, advertising and sales</li>\n<li>Bank interest from holding cash until after event</li>\n                        </ul>', 'en', 'live', NULL, 1390449593, '2014-01-23 20:08:36'),
