(313, 'ul classmarketresearch                            lino online concert ticket vendors also support extensive music stations or playlistsli                            liconcert ticket sold 52 million 2011  a classsourcelink hrefhttpwwwstatisticbraincomconcertticketsalestatistics targetblanksourceali                            liconcert ticket revenue 31 billion usd 2011  a classsourcelink hrefhttpwwwstatisticbraincomconcertticketsalestatistics targetblanksourceali                            lipollstar lists 10859 touring artists 71823 events  a classsourcelink hrefhttpmoneyfutureofmusicorghowmanymusiciansarethere targetblanksourceali                            lia hrefhttpmusicbrainzorgstatistics targetblankmusicbrainzorgstatisticsali                            lia classsourcelink hrefhttpwwwascapcomabout targetblankascapa 435000 composters songwriters music publishersli                            lia classsourcelink hrefhttpwwwbmicomabout targetblankbmia 500000 composters songwriters music publishersli                                                    ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 115, '/deck', 'taylormadetraffic.com', '<ul class=\'marketresearch\'>\n\n<li>No proveedores de billetes conciertos también tienen estaciones de música ni listas de reproducción</li>\n\n<li>Boletas vendido: 52 million (2011 en EE.UU) - <a class=\'sourceLink\' href=\"http://www.statisticbrain.com/concert-ticket-sale-statistics/\" target=\"_blank\">source</a></li>\n\n<li>Ingresa bruta de boletas vendido: 3.1 Billion USD (2011 en EE.UU) - <a class=\'sourceLink\' href=\"http://www.statisticbrain.com/concert-ticket-sale-statistics/\" target=\"_blank\">source</a></li>\n\n<li><a class=\'sourceLink\' href=\"http://money.futureofmusic.org/how-many-musicians-are-there/\" target=\"_blank\">Pollstar</a> dice que en 2012 habría 10.859 artistas en giras y 71.823 eventos</li>\n\n<li>815.000 artistas se registraron en <a href=\"http://musicbrainz.org/statistics\" target=\'_blank\'>musicbrainz.org</a></li>\n\n<li><a class=\'sourceLink\' href=\"http://www.ascap.com/about/\" target=\"_blank\">ASCAP</a>: tienen 435,000 compostadores, compositores, editores de música</li>\n\n<li><a class=\'sourceLink\' href=\"http://www.bmi.com/about\" target=\"_blank\">BMI</a>: tienen 500,000 compostadores, compositores, editores de música</li> \n\n</ul>', '<ul class=\'marketresearch\'>\n                            <li>NO online concert ticket vendors also support extensive music stations or playlists</li>\n                            <li>Concert Ticket sold 52 million (2011) - <a class=\'sourceLink\' href=\"http://www.statisticbrain.com/concert-ticket-sale-statistics/\" target=\"_blank\">source</a></li>\n                            <li>Concert Ticket Revenue 3.1 Billion USD (2011) - <a class=\'sourceLink\' href=\"http://www.statisticbrain.com/concert-ticket-sale-statistics/\" target=\"_blank\">source</a></li>\n                            <li>Pollstar lists 10,859 touring artists, 71,823 Events - <a class=\'sourceLink\' href=\"http://money.futureofmusic.org/how-many-musicians-are-there/\" target=\"_blank\">source</a></li>\n                            <li><a href=\"http://musicbrainz.org/statistics\" target=\'_blank\'>musicbrainz.org/statistics</a></li>\n                            <li><a class=\'sourceLink\' href=\"http://www.ascap.com/about/\" target=\"_blank\">ASCAP</a>: 435,000 composters, songwriters, music publishers</li>\n                            <li><a class=\'sourceLink\' href=\"http://www.bmi.com/about\" target=\"_blank\">BMI</a>: 500,000 composters, songwriters, music publishers</li>                            \n                        </ul>', 'en', 'live', NULL, 1390449593, '2014-01-23 17:45:19'),
