(316, 'ema virtual marketplace for independent retailers to publish and track promotions along with their returnoninvestment roiem                    pcustomers can search promotions and publish their own requests to nearby retailers for special deals the marketplace is focused on private offers only valid for a few hoursp', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 89, '/deck', 'taylormadetraffic.com', '<em>Un mercado virtual que permite que las empresas independientes puedan publicar  sus promociones y hacerles seguimiento.</em>\n\n<p>A través de esta aplicación podrás saber cuánto dinero ahorras cuando logras aprovechar las promociones. Además los clientes pueden buscar ofertas y  también publicar sobre lo que necesitan. El mercado se centra en ofertas privadas válidas sólo por pocas horas.</p>', '<em>A virtual marketplace for independent retailers to publish and track promotions, along with their return-on-investment (ROI).</em>\n                    <p>Customers can search promotions and publish their own requests to nearby retailers for special deals. The marketplace is focused on private offers only valid for a few hours.</p>', 'en', 'live', NULL, 1390449593, '2014-01-23 15:44:56'),
