(321, 'emthe first mobile beat machine to create and share music with friends in realtimeem                     plike most similar apps studioenvivo allows customizing your keyboard with sounds and laying background tracks as you playp                    phowever unlike any other app you can play simultaneously with other friends via bluetooth  chord  allshare frameworks and finally stitch together your recordings for a collaborative compositionp                    pas users upload their compositions to the cloud the social aspect of sharing and comparing compositions are endlessp', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/biz_projects.php', 89, '/deck', 'taylormadetraffic.com', '<em>La primera máquina de ritmo para crear y compartir música  en tiempo real con distintos amigos y a través del teléfono móvil.</em> \n<p>StudioEnVivo te permite jugar personalizando tu teclado con sonidos, mientras escuchas una canción de fondo.</p>\n\n<p>Sin embargo, la diferencia con otras aplicaciones es que en esta puedes jugar con otros amigos y compartir lo que haces a través de Bluetooth / Chord/ All-Share. Finalmente podrás fusionar las grabaciones para lograr una composición única.</p>\n\n<p>Los usuarios pueden subir sus creaciones a la  red, compartirlas y comparar composiciones infinitas.</p>', '<em>The first mobile beat machine to create and share music with friends in real-time.</em> \n                    <p>Like most similar apps, StudioEnVivo allows customizing your keyboard with sounds and laying background tracks as you play.</p>\n                    <p>However, unlike any other app, you can play simultaneously with other friends via Bluetooth / Chord / All-Share frameworks and finally stitch together your recordings for a collaborative composition.</p>\n                    <p>As users upload their compositions to the cloud, the social aspect of sharing and comparing compositions are endless...</p>', 'en', 'live', NULL, 1390449593, '2014-01-23 15:51:25'),
