(423, 'pi have a passion for music art culture and education to diversify my exposure and knowledge of those subjects i live between san francisco california bogot colombia and the hawaiian island of kauaippcombined with skills in an array of computer technologies as well as broad experiences in business development my focus is helping companies develop their own systems and finding strategies for expansion throughout south americappwhere ever you are in the world if you have a product you are also passionate about and feel i could be of service i love a good excuse to travel and will generally assume the cost for serious inquiries to do so i am always available via email span classalinkeattaylormadetrafficcomspan google voice span classalink14153000834span or skype span classalinkskyeelispanp', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 22, '/eli', 'taylormadetraffic.com', '<p>Tengo una pasión por la música, el arte, la cultura y la educación. Para diversificar mi exposición y conocimientos de estos, yo vivo entre San Francisco, California, Bogotá, Colombia, y la isla Hawaiana de Kauai.</p> \n\n<p>En combinación con habilidades en una serie de tecnologías, y experiencias amplias en el desarrollo de negocios, mi objetivo es ayudar a las empresas a desarrollar sus propios sistemas y la búsqueda de estrategias de expansión en toda Sur / Centro América.</p>\n\n<p>Donde quiera que usted se encuentre en el mundo, si tiene un producto por el cual está apasionado y siente que yo pueda ser de servicio, sería una buena excusa para viajar porque me enacanta y yo asumiría los costos. Por eso, estoy siempre disponible a través de correo electrónico: <span class=\'alink\'>eat@taylormadetraffic.com</span>, google voice: <span class=\'alink\'>1-415-300-0834</span> o, skype: <span class=\'alink\'>skye_eli</span></p>', '<p>I have a passion for music, art, culture and education. To diversify my exposure and knowledge of these, I live between San Francisco, California, Bogotá, Colombia, and the Hawaiian Island of Kauai.</p>\n\n<p>Combined with skills in an array of computer technologies as well as broad experiences in business development, my focus is helping companies develop their own systems and finding strategies for expansion throughout South America.</p>\n\n<p>Wherever you are in the world, If you have a product you are also passionate about and feel I could be of service, I love a good excuse to travel and will generally assume the cost for serious inquiries. To do so, I am always available via email: <span class=\'alink\'>eat@taylormadetraffic.com</span>, google voice: <span class=\'alink\'>1-415-300-0834</span> or, skype: <span class=\'alink\'>skye_eli</span></p>', 'en', 'live', NULL, 1390449711, '2014-01-25 21:10:32'),
