INSERT INTO `langtracker` (`langtracker_id`, `langtracker_key`, `langtracker_type`, `langtracker_file`, `langtracker_linenum`, `langtracker_url`, `langtracker_host`, `langtracker_es`, `langtracker_en`, `langtracker_language`, `langtracker_status`, `langtracker_oauthor_id`, `langtracker_added`, `langtracker_updated`) VALUES
(486, 'idinteractive builds marketing platforms for a long list of great clients with creative projects and campaigns one of the most fun i built in a quick 4 weeks was  the campaign was based on 20 million codes printed on oreo packages throughout colombia there were 5 types of prizes to win in varying amounts with a total of 285 to give  no one code could be considered a winner in advance and the prizes should be distributed evenly throughout the 60 day campaign i wrote the probability to be related to the average number of people playing daily and distributed all prizes  by number and type  evenly until the last day', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'IDinteractive builds marketing platforms for a long list of great clients with creative projects and campaigns. The campaign was based on 20 million codes printed on Oreo packages throughout Colombia. There were 5 types of prizes to win in varying amounts with a total of 285 to give.  No one code could be considered a winner in advance, and the prizes should be distributed evenly throughout the ~60 day campaign. I wrote the probability to be related to the average number of people playing daily and distributed all prizes - by number and type - evenly until the last day.', 'en', 'live', NULL, 1390449711, '2014-09-16 08:49:34'),
(487, 'a search against the 20 million codes took 00020 seconds and the site supported business rules such as catpcha when a user searched more than 12 times in a day i also included several backend tracking tools and an automated qa tester to simulate varying degrees of traffic code searches and minimum probabilities', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'A search against the 20 million codes took .00020 seconds, and the site supported business rules such as Catpcha when a user searched more than 12 times in a day. I also included several backend tracking tools and an automated QA tester to simulate varying degrees of traffic, code searches, and minimum probabilities.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
