(490, 'a mobile beat machine to create and share music with friends', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'A mobile beat machine to create and share music with friends', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(491, 'the music is shared a runtime using galaxys allshare and chord framework', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'The music is shared a runtime using Galaxy\'s All-Share and Chord Framework', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(492, 'the tool automates monthly reports due clients by aggregating data from all active marketing channels or installed tracking tools such as twitter facebook insights google analytics and youtube', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'The tool automates monthly reports due clients, by aggregating data from all active marketing channels or installed tracking tools, such as Twitter, Facebook Insights, Google Analytics and, YouTube.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(493, 'over 45 google visualization graphs can be created in less than 10 seconds by entering just a few project goals in the form of kpis key performance indicators graphs are automatically colorized in to indicate how they are performing project  account managers can also using a simple cms built within the reports to comment on specific metrics add headers group graphics change sizes and drill on the data through ajax connections to all the original api services the permissions matrix is controlled per client brand and project with 6 levels of access including publishing public reports with encrypted urls the original codebase was written in the laraval php framework which somewhat resembles ruby i have since completely replaced that codebase with codeigniter', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'Over 45 Google Visualization Graphs can be created in less than 10 seconds. By entering just a few project goals in the form of KPIs (Key Performance Indicators), graphs are automatically colorized in to indicate how they are performing. Project & account managers can also using a simple CMS built within the reports to comment on specific metrics, add headers, group graphics, change sizes and drill on the data through AJAX connections to all the original API services. The permissions matrix is controlled per client, brand, and project with 6 levels of access, including publishing public reports with encrypted URLs. The original codebase was written in the Laraval PHP Framework which somewhat resembles Ruby. I have since completely replaced that codebase with CodeIgniter.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(494, 'a curlyhair competition for a 250 shopping spree', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'A curly-hair competition for a $250 shopping spree', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(495, 'another quick campaign application to generate fanpage likes in order to compete users were required to like sedals fanpage complete registration and upload videos images or a tip on maintaining their curly hair ideally using sedal products voting was validated by ip user agent and session while video uploads were postd directly to a public youtube channel using their php sdk the project extended ids fork of the slim php framework i personally found more hurdles than helpers in the tightly namespaced codebase and its odd use of closures for routingcontrollers', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'Another quick campaign application to generate FanPage likes. In order to compete users were required to like Sedal\'s FanPage, complete registration, and upload videos, images, or a tip on maintaining their curly hair (ideally using Sedal products;). Voting was validated by IP, user agent, and session, while video uploads were POST\'d directly to a public YouTube channel using their PHP SDK. The project extended ID\'s fork of the Slim PHP Framework. I personally found more hurdles than helpers in the tightly namespaced codebase and it\'s odd use of closures for routing/controllers.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(496, 'a tool for independent retailers to publish and track promotions along with their returned value and cost for consumers lealtadcard provides a way to search nearby promotions and publish their own controlled requests for good deals', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'A tool for independent retailers to publish and track promotions, along with their returned value and cost. For consumers, LealtadCard provides a way to search nearby promotions and publish their own controlled requests for good deals.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(497, 'the promotions could be sent via sms or galaxys chord framework the interface and cms is still in development', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'The promotions could be sent via SMS or Galaxy\'s Chord Framework. The interface and CMS is still in development.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(498, 'a plugin for codeigniter that manages translations of system copy and usergenerated content it was built within track authority this site and extended for interactives dashboard project in order to version control text changes by authorized userauthors', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'A plugin for CodeIgniter that manages translations of system copy and user-generated content. It was built within Track Authority, this site, and extended for Interactive\'s Dashboard project in order to version control text changes by authorized user/authors', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(499, 'includes 8 configuration for tracking and translating system text and usergeneratedcontent by environment and language', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'Includes 8 configuration for tracking and translating system text and user-generated-content by environment and language', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(500, 'an online and mobile game that rewards high rated users with free music gift certificates concert tickets and cash', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'An online and mobile game that rewards high rated users with free music, gift certificates, concert tickets and cash.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(501, 'the website runs in a lamp environment and is highly optimized by several bash scripts                    ul                    lione is run from a cron to use imagemagick for cropping and resizing images based on automated cue table maintained when a size or shape is requested that has not yet been cutli                    lianother is for reindexing the music catalogue  of 20000 songs and growing it extends a tool called beets to correct mp3 metadata download artwork and lyrics and determine soundwave averages such as bpm beatsperminute and replay gain used to determine average encoded decibel volume of the sound waveli                    lithe backend system also includes an asynchronous email service which i linked seamlessly to the frontend webpage templates with a css inliner scriptli                    lithe site scales very well to all screen widths above 320 pixels wide but i am well underway with a native android version of the player with 0100 scale music ratings to refine the rotation of songsli                    liit also includes a codeigniter plugin that manages translations of system copy and usergenerated content with version controlling text changes by authorized userauthorsli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'The website runs in a LAMP environment, and is highly optimized by several Bash scripts\n                    <ul>\n                    <li>One is run from a CRON to use ImageMagick for cropping and resizing images based on automated cue table maintained when a size or shape is requested that has not yet been cut.</li>\n                    <li>Another is for re-indexing the music catalogue - of 20,000 songs and growing. It extends a tool called Beets to correct mp3 meta-data, download artwork and lyrics, and determine sound-wave averages such as BPM (beats-per-minute) and Replay Gain (used to determine average encoded decibel volume of the sound wave).</li>\n                    <li>The backend system also includes an asynchronous email service which I linked seamlessly to the front-end webpage templates with a CSS inliner script.</li>\n                    <li>The site scales very well to all screen widths above 320 pixels wide, but I am well underway with a native Android version of the player with 0-100 scale music ratings to refine the rotation of songs.</li>\n                    <li>It also includes a CodeIgniter plugin that manages translations of system copy and user-generated content, with version controlling text changes by authorized user/authors.</li>\n                </ul>', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(502, 'a set of 30 health assessment and preparation tools developed for optumhealth a division of unitedhealth group', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'A set of 30 health assessment and preparation tools developed for OptumHealth, a division of UnitedHealth Group', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(503, 'the business requirements insisted that the tool be distributable as a single selfcontained file which could be easily reskinned for other brands it was not clear if their target devices would run java applets but certain they had browsers with flash so used flex and as3', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'The business requirements insisted that the tool be distributable as a single self-contained file which could be easily reskinned for other brands. It was not clear if their target devices would run Java (Applets), but certain they had browsers with Flash, so used Flex and AS3.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(504, 'these two links are just a few of the very interactive microsites  applications i built for healthlines editorial team or sponsoring partners', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'These two links are just a few of the very interactive microsites / applications I built for Healthline\'s editorial team or sponsoring partners.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
