(507, 'a social networking tool for connecting sellers buyers and services', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'A social networking tool for connecting sellers, buyers, and services', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(508, 'ul                    liwrote advanced search logic for finding and filtering results by type distance price date time and other criteriali                    liplotted all search results on a google mapping application  by distance using the haversine formula  with custom markers for cubi type upon clicking markers expanded with tabbed windows to provide additional streetviews cubi details and directions using google maps v2 apili                    libuilt facebook application using fbconnect to post on user walls and send messages to friends inboxesli                    liintegrated and upgraded social networking inviter script to sharepublish user profiles and details across a dozen email clients and two dozen social networksli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n                    <li>Wrote advanced search logic for finding and filtering results by type, distance, price, date, time and other criteria.</li>\n                    <li>Plotted all search results on a Google mapping application - by distance using the Haversine formula - with custom markers for Cubi type. Upon clicking markers expanded with tabbed windows to provide additional StreetViews, \'cubi\' details, and directions (using Google maps v2 API).</li>\n                    <li>Built Facebook application (using FBConnect) to post on user walls and send messages to friend\'s inboxes.</li>\n                    <li>Integrated and upgraded social networking \'inviter\' script to share/publish user profiles and details across a dozen email clients and two dozen social networks.</li>\n                </ul>', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(509, 'design  developed a unique interface for navigating articles essays events and new program initiatives this was a volunteer project with early ambitions for a commercial joint venture it fell apart over internal issues', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'Design & developed a unique interface for navigating articles, essays, events, and new program initiatives. This was a volunteer project with early ambitions for a commercial joint venture. It fell apart over internal issues.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(510, 'implemented the google language api php to translate entire site and individual articles to nearly any language using an asynchronous ajax cueengine to control http request priorities frequency and timeouts extended open source cms opencart with configuration options to map and restylize all products and profiles', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'Implemented the Google Language API (php) to translate entire site and individual articles to nearly any language using an asynchronous AJAX cue-engine to control http request priorities, frequency and timeouts. Extended open source CMS OpenCart with configuration options to map and re-stylize all products and profiles', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(511, 'a contextual enrichment tool of richmedia health information and ads', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'A Contextual Enrichment Tool of Rich-Media Health Information and Ads.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(512, 'ul                    linavigator is a crossdomain script tag used to inject contextual ads and content onto any web page from a single line of javascriptli                    lithe system supports up to 60 requests per second including tracking pixels and over 50000 sql inserts batched daily through an asynchronous sql loader clients included healthlinecom sharecarecom healthyahoonet drugscom and othersli                    liunits can be injected onload and by userengagement directly on the page or by hyperlinking keywords in the page source keywords can be preselected during the crawling process or via a clientside dom scanner searching common semantics and other ad tags running simultaneously this allows well targeted advertising services without a backend processor for contextualizationli                    liit can automatically detect appropriate ad placement via another dom scanner that measures elements amount of text dimensions dom structure and tag types it also can be more tightly controlled via dashboard described belowli                    liinjected content  where hyperlinks remain on the host website  can be placed to provide additional navigation tools for the user however this requires preindexing the clients entire site this process is targeted cued and controlled by navigator and its dashboard described belowli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n                    <li>Navigator is a cross-domain script tag used to inject contextual ads and content onto any web page from a single line of JavaScript.</li>\n                    <li>The system supports up to 60 requests per second including tracking pixels and over 50,000 SQL inserts batched daily through an asynchronous SQL loader. (Clients included healthline.com, sharecare.com, health.yahoo.net, drugs.com and others)</li>\n                    <li>Units can be injected on-load and by user-engagement, directly on the page, or by hyper-linking keywords in the page source. Keywords can be pre-selected during the crawling process or via a client-side DOM scanner searching common semantics and other ad tags running simultaneously. This allows well targeted advertising services without a backend processor for contextualization</li>\n                    <li>It can automatically detect appropriate ad placement via another DOM scanner that measures element\'s amount of text, dimensions, DOM structure and tag types. It also can be more tightly controlled via Dashboard described below.</li>\n                    <li>Injected content - where hyper-links remain on the host website - can be placed to provide additional navigation tools for the user. However this requires pre-indexing the client\'s entire site. This process is targeted, cued and controlled by Navigator and its Dashboard, described below.</li>\n                </ul>', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(513, 'dashboard is an allinone contentmanagementsystem reporting and ad configuration tool it controls where when and why to inject ads or content in webpages it also allows reviewing navigator healthstat and internal crawlers performance across various installations', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'Dashboard is an all-in-one Content-Management-System, Reporting, and Ad Configuration tool. It controls where, when and why to inject ads or content in webpages. It also allows reviewing Navigator, healthSTAT, and internal crawler\'s performance across various installations.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(514, 'ul                    lidashboard aids in backend debugging of the healthline taxonomy and search decisions it also provides the crawler additional controls for prioritizing areas of the page to parse skip and flag for changes or interlinking li                    lithrough dashboard you can rebuild any webpage within a proxy environment on healthline servers in order to install test and demonstrate navigation functionality on any urlli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n                    <li>Dashboard aids in backend debugging of the Healthline Taxonomy and search decisions. It also provides the crawler additional controls for prioritizing areas of the page to parse, skip, and flag for changes or inter-linking .</li>\n                    <li>Through Dashboard you can rebuild any webpage within a proxy environment on Healthline servers in order to install, test, and demonstrate Navigation functionality on any URL</li>\n                </ul>', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(515, 'automated quality assurance  monitoring through interactive intelligent browserbased crawling', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'Automated Quality Assurance & Monitoring Through Interactive, Intelligent Browser-Based Crawling.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
(516, 'ul                    lia google chrome extension and browserbased crawler to automate qa of both source code flash ads any javascript installationli                    libuilds automated reports on how pages are categorized by many different engines and apis while tracking the web of links between each page everything is stored in sqlite localstorage via lawnchair ex healthlinecomcorporatenavigatorstagecrawlerhtmldomainsharecare  or domainhealthline both take a while to load all 30k rowsli                    litakes jpg screenshots of every page crawled it can also first render watermarks or outline all areas of the page by targeting categories for easier review amp debuggingli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n                    <li>A Google Chrome Extension and browser-based Crawler to automate QA of both source code, flash ads, any JavaScript installation.</li>\n                    <li>Builds automated reports on how pages are categorized by many different engines and APIs, while tracking the web of links between each page. Everything is stored in SQLite LocalStorage via Lawnchair. Ex. healthline.com/corporate/navigator/stage/crawler.html?domain=sharecare  or ?domain=healthline (both take a while to load all 30K rows)</li>\n                    <li>Takes .jpg screenshots of every page crawled. It can also first render watermarks or outline all areas of the page by targeting categories for easier review &amp; debugging.</li>\n                </ul>', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
