(520, 'developed flexbased interface for a patients medical records system extended the serverside services to generate dynamic pdf fpdf of records and record requests pdfs were then automatically faxed to physician offices when 5 available incoming fax lines to parse and import records using myfaxcom api the application also included other libraries and components such as esigning with flex and hospital searches by location and specialty', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'Developed Flex-based interface for a patient\'s medical records system. Extended the server-side services to generate dynamic PDF (fpdf) of records and record requests. PDFs were then automatically faxed to physician offices when 5 available incoming fax lines to parse and import records (using myFax.com API). The application also included other libraries and components such as e-signing with Flex and hospital searches by location and specialty.', 'en', 'debug', NULL, 1390449711, '2014-01-23 04:01:51'),
