(526, 'ul                           liintegrated buildingsafetysolutions wwwbssnetcom emergency evacuation training program with ameriprise financials learningmanagementsystem lms used flashs external interface to join the interface and scorm 12 lmsli                liwrote a jsfl script to export convert and organize named layers directly from illustrator cs3 into a single flash movie clip a naming convention for each layer in illustrator specified how movie clips were named and embedded within each other this provided the core content for a standalone flash product which i built to allow safety professionals and engineers to zoom and locate safety equipment stairwells sprinklers and more on every floor throughout multiple skyscrapersli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, '<ul>           \n                <li>Integrated Building-Safety-Solution\'s (www.bssnet.com) emergency evacuation training program with Ameriprise Financial\'s Learning-Management-System (LMS). Used Flash\'s External Interface to join the interface and Scorm 1.2 LMS</li>\n                <li>Wrote a JSFL script to export, convert and organize named layers directly from Illustrator CS3 into a single Flash movie clip. A naming convention for each layer in Illustrator specified how movie clips were named and embedded within each other. This provided the core content for a standalone Flash product which I built to allow safety professionals and engineers to zoom and locate safety equipment, stairwells, sprinklers and more, on every floor, throughout multiple skyscrapers.</li>\n                </ul>', 'en', 'debug', NULL, 1390449712, '2014-01-23 04:01:52'),
