(537, 'ul                lithe collectiv was born in the summer of 2001 in oakland ca our organization was founded by a williams aka sokrates with a mission to empower the hip hop community through education and entrepreneurship we pursue this mission by sponsoring a diverse range of programs with distinct yet cooperative goals we work with young entrepreneurs activists and artists to design financially viable programs that will provide new opportunities for empowerment we seek to create the perfect environment for turning an idea into impactli                lithe collectiv currently sponsors three programs collectiv records collectiv arts amp entertainment and collectiv foundation each of these programs occupies a distinct niche within the hip hop communityli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n                <li>The Collectiv was born in the summer of 2001 in Oakland, CA. Our organization was founded by A. Williams, aka Sokrates, with a mission to \"empower the Hip Hop community through education and entrepreneurship.\" We pursue this mission by sponsoring a diverse range of programs with distinct yet cooperative goals. We work with young entrepreneurs, activists and artists to design financially viable programs that will provide new opportunities for empowerment. We seek to create the perfect environment for turning an idea into impact.</li>\n                <li>The Collectiv currently sponsors three programs, Collectiv Records, Collectiv Arts &amp; Entertainment and Collectiv Foundation. Each of these programs occupies a distinct niche within the Hip Hop community.</li>\n                </ul>', 'en', 'debug', NULL, 1390449712, '2014-01-23 04:01:52'),
