(597, 'the tripchi airport app recommends things to do in the airport based on your interests flight details amp location', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'The tripchi airport app recommends things to do in the airport based on your interests, flight details, &amp; location', 'en', 'debug', NULL, 1410848080, '2014-09-16 06:14:40'),
(598, 'pthe cms was built using drupal with several custom modules to set default filters based users profiles location and flight information those settings are currently based on manual mappings of location categories to profile attributes andor how much time the user has until hisher flight basic airport and flight data mostly comes from the flightstats api this includes runtime queries for any delayed flights and weather information at the users selected airport ppthe app is built with jquery mobile and a responsive html5 interface it is compiled using cordova 35 and nodejs for native platform installations the android installation can be a hrefhttpcmstripchicomtripchiapk targetblank downloaded hereap', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, '<p>The CMS was built using Drupal with several custom modules to set default filters based users\' profiles, location, and flight information. Those settings are currently based on manual mappings of location categories to profile attributes and/or how much time the user has until his/her flight. Basic airport and flight data mostly comes from the FlightStats API. This includes runtime queries for any delayed flights and weather information at the user’s selected airport. </p>\r\n\r\n\r\n<p>The app is built with Jquery Mobile and a responsive HTML5 interface. It is compiled using Cordova 3.5 and NodeJS for native platform installations. The Android installation can be <a href=\"http://cms.tripchi.com/tripchi.apk\" target=\"_blank\" >downloaded here</a>.</p>', 'en', 'debug', NULL, 1410848080, '2014-09-16 06:14:40'),
(599, 'the tripchi airport app recommends things to do in the airport based on your interests flight details amp location it also provides a network for users to share rides into town and find things to do during longlayovers', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'The tripchi airport app recommends things to do in the airport based on your interests, flight details, &amp; location. It also provides a network for users to share rides into town and find things to do during long-layovers.', 'en', 'debug', NULL, 1410848239, '2014-09-16 06:17:19'),
(600, 'pthe cms was built using drupal with several custom modules to set default filters based users profiles location and flight information those settings are currently based on manual mappings of location categories to profile attributes andor how much time the user has until hisher flight basic airport and flight data mostly comes from the flightstats api this includes flight delay  and weather information at the users selected airport ppthe app is built with jquery mobile and a responsive html5 interface it is compiled using cordova 35 and nodejs for native platform installations the android installation can be a hrefhttpcmstripchicomtripchiapk targetblank downloaded hereap', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, '<p>The CMS was built using Drupal with several custom modules to set default filters based users\' profiles, location, and flight information. Those settings are currently based on manual mappings of location categories to profile attributes and/or how much time the user has until his/her flight. Basic airport and flight data mostly comes from the FlightStats API. This includes flight delay  and weather information at the user’s selected airport. </p>\r\n\r\n\r\n<p>The app is built with Jquery Mobile and a responsive HTML5 interface. It is compiled using Cordova 3.5 and NodeJS for native platform installations. The Android installation can be <a href=\"http://cms.tripchi.com/tripchi.apk\" target=\"_blank\" >downloaded here</a>.</p>', 'en', 'debug', NULL, 1410848239, '2014-09-16 06:17:19'),
(601, 'idinteractive builds marketing platforms for a long list of great clients with creative projects and campaigns the campaign was based on 20 million codes printed on oreo packages throughout colombia there were 5 types of prizes to win in varying amounts with a total of 285 to give  no one code could be considered a winner in advance and the prizes should be distributed evenly throughout the 60 day campaign i wrote the probability to be related to the average number of people playing daily and distributed all prizes  by number and type  evenly until the last day', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'IDinteractive builds marketing platforms for a long list of great clients with creative projects and campaigns. The campaign was based on 20 million codes printed on Oreo packages throughout Colombia. There were 5 types of prizes to win in varying amounts with a total of 285 to give.  No one code could be considered a winner in advance, and the prizes should be distributed evenly throughout the ~60 day campaign. I wrote the probability to be related to the average number of people playing daily and distributed all prizes - by number and type - evenly until the last day.', 'en', 'debug', NULL, 1410858898, '2014-09-16 09:14:58'),
(602, 'lealtad card is a tool for independent retailers to publish and track promotions along with their returned value and cost for consumers lealtadcard provides a way to search nearby promotions and publish their own controlled requests for good deals', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'Lealtad card is a tool for independent retailers to publish and track promotions, along with their returned value and cost. For consumers, LealtadCard provides a way to search nearby promotions and publish their own controlled requests for good deals.', 'en', 'debug', NULL, 1410858898, '2014-09-16 09:14:58'),
(603, 'lenguaplus is a plugin for codeigniter that manages translations of system copy and usergenerated content it was built within track authority this site and extended for id interactives dashboard project in order to version control text changes by authorized userauthors', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, 'Lenguaplus is a plug-in for CodeIgniter that manages translations of system copy and user-generated content. It was built within Track Authority, this site, and extended for ID Interactive\'s Dashboard project in order to version control text changes by authorized user/authors', 'en', 'debug', NULL, 1410858898, '2014-09-16 09:14:58'),
(604, 'eli implemented the google language api php to translate entire site and individual articles to nearly any language using an asynchronous ajax cueengine to control http request priorities frequency and timeouts extended open source cms opencart with configuration options to map and restylize all products and profiles', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'Eli implemented the Google Language API (php) to translate entire site and individual articles to nearly any language using an asynchronous AJAX cue-engine to control http request priorities, frequency and timeouts. Extended open source CMS OpenCart with configuration options to map and re-stylize all products and profiles', 'en', 'debug', NULL, 1410858898, '2014-09-16 09:14:58'),
(605, 'started', 'msg', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 138, '/eli', 'taylormadetraffic.com', NULL, 'started', 'en', 'debug', NULL, 1410870500, '2014-09-16 12:28:20'),
(606, 'the music is shared a runtime using galaxys allshare and chord framework this internal project was never completed but i still have hopes to revive it with the right team please reach out if youre interested in working together', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 135, '/technologies?qtfilter=Java', 'www.taylormadetraffic.com', NULL, 'The music is shared a runtime using Galaxy\'s All-Share and Chord Framework. This internal project was never completed but I still have hopes to revive it with the right team. Please reach out if you\'re interested in working together.', 'en', 'debug', NULL, 1410922516, '2014-09-17 02:55:16'),
(607, 'pthe cms was built using drupal with several custom modules to set default filters based users profiles location and flight information those are currently based on manual mappings of location categories to profile settings andor how much time the user has until hisher flight flight status and weather information are queried from the flightstats apippthe app is built with jquery mobile and a responsive html5 interface it is compiled using cordova 35 and nodejs for native platform installations the android installation can be a hrefhttpcmstripchicomtripchiapk targetblank downloaded hereap', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 135, '/eli', 'www.taylormadetraffic.com', NULL, '<p>The CMS was built using Drupal with several custom modules to set default filters based users\' profiles, location, and flight information. Those are currently based on manual mappings of location categories to profile settings and/or how much time the user has until his/her flight. Flight status and weather information are queried from the FlightStats API.</p>\r\n\r\n\r\n<p>The app is built with jQuery Mobile and a responsive HTML5 interface. It is compiled using Cordova 3.5 and NodeJS for native platform installations. The Android installation can be <a href=\"http://cms.tripchi.com/tripchi.apk\" target=\"_blank\" >downloaded here</a>.</p>', 'en', 'debug', NULL, 1410932069, '2014-09-17 05:34:29'),
