(654, 'blingby lets users live the experience of their favorite music videos and movie trailors blingby llc tags topvoted youtube videos with purchase links so products hotels and artists can be found insync with the video', 'ugc', '/home/eataylor/tmt/application/views/projects_table.php', 134, '/eli', 'localhost.taylormadetraffic.com', NULL, 'Blingby lets users \'live the experience\' of their favorite music videos and movie trailors. Blingby LLC tags top-voted YouTube videos with purchase links so products, hotels, and artists are shown in-sync as the video plays.', 'en', 'live', NULL, 1460434311, '2016-04-12 04:19:43'),
(655, 'this project is built atop an extremely customized version of drupal 7 it includes hooks to search content internally as well as against the amazon store for album artwork and against youtube for additional matching videos i rebuilt the websites templates for a more responsive experience across devices as well as backend search features to order affiliate ad links based on the users location in addition i built several administrative tools for reviewing and correcting bad dataentry based on error logs and the urlalias table', 'ugc', '/home/eataylor/tmt/application/views/projects_table.php', 135, '/eli', 'localhost.taylormadetraffic.com', NULL, 'This project is built atop an extremely customized version of Drupal 7. It includes hooks to search content internally as well as against the Amazon Store for album artwork, and against youtube for additional matching videos. I rebuilt the website\'s templates for a more responsive experience across devices, as well as backend search features to order affiliate (ad) links based on the user\'s location. In addition, I built several administrative tools for reviewing and correcting bad data-entry based on error logs and the url_alias table', 'en', 'debug', NULL, 1460434311, '2016-04-12 04:11:51'),
(656, 'blingby lets users live the experience of their favorite music videos and movie trailors blingby llc tags topvoted youtube videos with purchase links so products hotels and artists are shown insync as the video plays', 'ugc', '/home/eataylor/tmt/application/views/projects_table.php', 134, '/eli', 'localhost.taylormadetraffic.com', NULL, 'Blingby lets users \'live the experience\' of their favorite music videos and movie trailors. Blingby LLC tags top-voted YouTube videos with purchase links so products, hotels, and artists are shown in-sync as the video plays.', 'en', 'debug', NULL, 1460434929, '2016-04-12 04:22:09'),
(657, 'over 45 google visualization graphs can be created in less than 10 seconds by entering just a few project goals in the form of kpis key performance indicators graphs are automatically colorized in to indicate how they are performing project  account managers can also using a simple cms built within the reports to comment on specific metrics add headers group graphics change sizes and drill on the data through ajax connections to all the original api services the permissions matrix is controlled per client brand and project with 6 levels of access including publishing public reports with encrypted urls the codebase is in codeignitor 2', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 150, '/technologies?qtfilter=Google%20SDK', 'taylormadetraffic.com', NULL, 'Over 45 Google Visualization Graphs can be created in less than 10 seconds. By entering just a few project goals in the form of KPIs (Key Performance Indicators), graphs are automatically colorized in to indicate how they are performing. Project & account managers can also using a simple CMS built within the reports to comment on specific metrics, add headers, group graphics, change sizes and drill on the data through AJAX connections to all the original API services. The permissions matrix is controlled per client, brand, and project with 6 levels of access, including publishing public reports with encrypted URLs. The codebase is in CodeIgnitor 2.', 'en', 'debug', NULL, 1460449720, '2016-04-12 08:28:40'),
