(665, 'this project is built on an extremely customized version of drupal 7 it includes hooks to search content internally as well as against the amazon store for album artwork and against youtube for additional matching videos i optimized much of that and rebuilt the websites templates for a more responsive experience across devices as well i extended the internal ad lookups to reorder affiliate ad links based on the users location in addition i built several administrative tools for configuring page settings photos carousels and reviewing dataintegrity from error logs and the urlalias table i joined this project after its launch and left when development was consolidated under a single marketing firm there have been several other great team members on this i cannot all name', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/project_profile.php', 7, '/projects?pid=40', 'taylormadetraffic.com', NULL, 'This project is built on an extremely customized version of Drupal 7. It includes hooks to search content internally as well as against the Amazon Store for album artwork, and against youtube for additional matching videos. I optimized much of that and rebuilt the website\'s templates for a more responsive experience across devices. As well, I extended the internal ad lookups to re-order affiliate (ad) links based on the user\'s location. In addition, I built several administrative tools for configuring page settings, photos carousels, and reviewing data-integrity from error logs and the url_alias table. I joined this project after its launch and left when development was consolidated under a single marketing firm. There have been several other great team members on this I cannot all name.', 'en', 'debug', NULL, 1460713513, '2016-04-15 09:45:13'),
(666, 'the website is built on an customized version of drupal 7 it includes hooks to search content internally as well as against the amazon store for album artwork and against youtube for additional matching videos i optimized many parts of that and rebuilt the websites templates for a more responsive experience across devices and improved the lookups on related content and media aside from general css aesthetics another major focus was  the internal ad lookups to reorder affiliates links based on the users location in addition i built several administrative tools for configuring page settings photo carousels and reviewing dataintegrity from error logs and the urlalias table i joined this project after its launch and left when development was consolidated under a single marketing firm there have been several other great team members on this i cannot all name', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 150, '/companies?qtfilter=Blingby%20LLC', 'taylormadetraffic.com', NULL, 'The website is built on an customized version of Drupal 7. It includes hooks to search content internally as well as against the Amazon Store for album artwork, and against youtube for additional matching videos. I optimized many parts of that, and rebuilt the website\'s templates for a more responsive experience across devices, and improved the lookups on related content and media. Aside from general CSS aesthetics, another major focus was  the internal ad lookups to re-order affiliates\' links based on the user\'s location. In addition, I built several administrative tools for configuring page settings, photo carousels, and reviewing data-integrity from error logs and the url_alias table. I joined this project after its launch and left when development was consolidated under a single marketing firm. There have been several other great team members on this I cannot all name.', 'en', 'debug', NULL, 1461593693, '2016-04-25 14:14:53'),
