(669, 'pa vision from a hrefhttpwwwgooglecomcosearchqbikoeisenmartin targetblankbiko eisenmartina for his students at a hrefhttpbhsberkeleyschoolsnet targetblankberkeley high schoola to create a tool for teachers and students to collaborate and compete in the writing process modeled after a traditional newsroom students and teachers would be able to develop assignments work on multiple versions of a story share ideas within the class and more                     we built a prototype site that supported a semester of great essays still worth reading but the project lost momentum as we both moved citiesp                    pthis projects greatest potential was in a versioncontroller for teachers to review grade and provide feedback on students essays while peer reviews drove friendly competition between writer and school rankingsp                    pif you work in education or feel something like this could help your classroom or school district please email me id love bring it back to life in our spare timep', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 149, '/taylormade', 'taylormadetraffic.com', NULL, '<p>A vision from <a href=\"http://www.google.com.co/search?q=biko+eisen-martin\" target=\"_blank\">Biko Eisen-Martin</a> for his students at <a href=\"http://bhs.berkeleyschools.net/\" target=\"_blank\">Berkeley High School</a> to create a tool for teachers and students to collaborate and compete in the writing process. Modeled after a traditional newsroom, students and teachers would be able to develop assignments, work on multiple versions of a story, share ideas within the class, and more. \r\n                    We built a prototype site that supported a semester of great essays still worth reading, but the project lost momentum as we both moved cities.</p>\r\n                    <p>This project\'s greatest potential was in a version-controller for teachers to review, grade and provide feedback on student\'s