(692, 'the website and api runs in a lamp environment and is highly optimized by several bash scripts                    ul                    lione is run from a cron to use imagemagick for cropping and resizing images based on automated cue table maintained when a size or shape is requested that has not yet been cutli                    lianother is for reindexing the music catalogue  of 20000 songs and growing it extends a tool called beets to correct mp3 metadata download artwork and lyrics and determine soundwave averages such as bpm beatsperminute and replay gain used to determine average encoded decibel volume of the sound waveli                    lithe backend system also includes an asynchronous email service which seamlessly links to the frontend webpage templates with a css inliner scriptli                    lia cms helps manage users contents with 7 levels of access with special read  write permissionsli                    liit also includes a codeigniter plugin that manages translations of system copy and usergenerated content with version controlling text changes by authorized userauthorsli                ul', 'ugc', '/home/eataylor/tmt/application/views/project_profile.php', 7, '/projects?pid=11&dir=/wwwroot/images/sites/ta-admin', 'localhost.taylormadetraffic.com', NULL, 'The website and API runs in a LAMP environment, and is highly optimized by several Bash scripts\r\n                    <ul>\r\n                    <li>One is run from a CRON to use ImageMagick for cropping and resizing images based on automated cue table maintained when a size or shape is requested that has not yet been cut.</li>\r\n                    <li>Another is for re-indexing the music catalogue - of 20,000 songs and growing. It extends a tool called Beets to correct mp3 meta-data, download artwork and lyrics, and determine sound-wave averages such as BPM (beats-per-minute) and Replay Gain (used to determine average encoded decibel volume of the sound wave).</li>\r\n                    <li>The backend system also includes an asynchronous email service which seamlessly links to the front-end webpage templates with a CSS inliner script.</li>\r\n                    <li>A CMS helps manage users contents with 7 levels of access with special read / write permissions</li>\r\n                    <li>It also includes a CodeIgniter plug-in that manages translations of system copy and user-generated content, with version controlling text changes by authorized user/authors.</li>\r\n                </ul>', 'en', 'debug', NULL, 1467744640, '2016-07-05 18:50:40'),
