(699, 'pthis is a platform for building competitive and rewarding games around music each of the four current games has slightly different rules and timelines for turning challenges into playlists into compilationsppacross all games each challenge playlist theme must have at least one award and winner most games are free to enter and awards are sponsored by members or advertising companies the primary money making group will likely be fantasy track ball where it costs 5 to enter a track and the award is 80 of the pool yes betting on your own musical tastes to a theme currently of the four games only this one is open to public registration please request an invitation for the other gamesp', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/company_profile.php', 21, '/companies?qtfilter=Track+Authority+Music', 'www.taylormadetraffic.com', NULL, '<p>This is a platform for building competitive and rewarding games around music. Each of the four current games has slightly different rules and timelines for turning Challenges into Playlists into Compilations.</p><p>Across all games, each “Challenge” (playlist theme) must have at least one award and winner. Most games are free to enter, and awards are sponsored by members or advertising companies. The primary money making group will likely be “Fantasy Track Ball” where it costs ~$5 to enter a track and the award is ~80% of the pool. Yes, betting on your own musical tastes to a theme. Currently, of the four games, only this one is open to public registration. Please request an invitation for the other games.</p>', 'en', 'debug', NULL, 1468253752, '2016-07-11 16:15:52'),
(700, 'pas vendor locations are scraped and imported this tool tokenizes relevant terms and keeps track of how often they are found the 1tomany type category is chosen automatically based on calculations weighing each tag term to locations and their respective type the importer also avoids duplicate terms removes duplicate locations accommodates hardcoded stop words and merges some pluralitiesp', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 132, '/eli', 'taylormadetraffic.com', NULL, '<p>As vendor Locations are scraped and imported, this tool tokenizes relevant terms and keeps track of how often they are found. The 1-to-many \'Type\' category is chosen automatically based on calculations weighing each \'Tag\' term to Locations and their respective Type. The importer also avoids duplicate terms, removes duplicate Locations, accommodates hard-coded \"stop words\", and merges some pluralities.</p>', 'en', 'debug', NULL, 1469040213, '2016-07-20 18:43:33'),
(701, 'the website and api runs in a lamp environment built with codeignitor and hmvc modular extensions the system is highly optimized by several bash scripts                    ul                    lione is run from a cron to use imagemagick for cropping and resizing images based on an automated cue table maintained when a size or shape is requested that has not yet been cutli                    lianother is for reindexing the music catalogue  of 20000 songs and growing it extends a tool called beets to correct mp3 metadata download artwork  lyrics and determine soundwave averages such as bpm beatsperminute and replay gain used to determine average encoded decibel volume of the sound waveli                    lithe backend system also includes an asynchronous email service which seamlessly links to the frontend webpage templates with a css inliner scriptli                    lia cms helps manage users contents with 7 levels of access with special read  write permissionsli                    liit also includes a codeigniter plugin that manages translations of system copy and usergenerated content with version controlling text changes by authorized userauthorsli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 132, '/eli', 'taylormadetraffic.com', NULL, 'The website and API runs in a LAMP environment built with CodeIgnitor and HMVC Modular Extensions. The system is highly optimized by several Bash scripts.\n                    <ul>\n                    <li>One is run from a CRON to use ImageMagick for cropping and resizing images based on an automated cue table maintained when a size or shape is requested that has not yet been cut.</li>\n                    <li>Another is for re-indexing the music catalogue - of 20,000 songs and growing. It extends a tool called Beets to correct mp3 meta-data, download artwork / lyrics, and determine sound-wave averages such as BPM (beats-per-minute) and Replay Gain (used to determine average encoded decibel volume of the sound wave).</li>\n                    <li>The backend system also includes an asynchronous email service which seamlessly links to the front-end webpage templates with a CSS inliner script.</li>\n                    <li>A CMS helps manage users contents with 7 levels of access with special read / write permissions</li>\n                    <li>It also includes a CodeIgniter plug-in that manages translations of system copy and user-generated content, with version controlling text changes by authorized user/authors.</li>\n                </ul>', 'en', 'debug', NULL, 1469040621, '2016-07-20 18:50:21'),
