(704, 'ul                    linavigator is a crossdomain script tag used to inject contextual ads and content onto any web page from a single line of javascriptli                    lithe system supports up to 60 requests per second including tracking pixels and over 50000 sql inserts batched daily through an asynchronous sql loader clients included healthlinecom sharecarecom healthyahoonet and othersli                    lirich media ads can be injected onload and from userengagement directly on the page or as hyperlinked keywords with small popup keywords can be chosen during a separate backend process or via a clientside dom scanner which uses xpath or css selectors andor other ad tags running simultaneously in order to find a relevant keyword this allows contextual advertising services without a backend processorli                    liit can automatically detects appropriate ad placement via another dom scanner that measures elements amount of text dimensions dom structure and tag types placement can also can be more tightly controlled via the healthline dashboard described belowli                    liinjected content  where the destination of links remain on same domain  can be placed to provide additional navigation tools for the user this requires preindexing the clients entire site this process is cued by navigator and refined by healthline dashboard described belowli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/companies?qtfilter=Healthline%20Networks', 'taylormadetraffic.com', NULL, '<ul>\r\n                    <li>Navigator is a cross-domain script tag used to inject contextual ads and content onto any web page from a single line of JavaScript.</li>\r\n                    <li>The system supports up to 60 requests per second including tracking pixels and over 50,000 SQL inserts batched daily through an asynchronous SQL loader. (Clients included healthline.com, sharecare.com, health.yahoo.net, and others)</li>\r\n                    <li>Rich media ads can be injected on-load and from user-engagement, directly on the page, or as hyper-linked keywords with small pop-up. Keywords can be chosen during a separate backend process or via a client-side DOM scanner which uses Xpath or CSS selectors, and/or other ad tags running simultaneously in order to find a relevant keyword. This allows contextual advertising services without a backend processor</li>\r\n                    <li>It can automatically detects appropriate ad placement via another DOM scanner that measures element\'s amount of text, dimensions, DOM structure and tag types. Placement can also can be more tightly controlled via the Healthline Dashboard described below.</li>\r\n                    <li>Injected content - where the destination of links remain on same domain - can be placed to provide additional navigation tools for the user. This requires pre-indexing the client\'s entire site. This process is cued by Navigator and refined by Healthline Dashboard, described below.</li>\r\n                </ul>', 'en', 'debug', NULL, 1473210995, '2016-09-07 01:16:35'),
(705, 'dashboard is an allinone contentmanagementsystem reporting and ad configuration tool it controls where when and why to inject ads or content in webpages it also allows reviewing navigator healthstat and the internal crawlers performance across various installations', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 136, '/companies?qtfilter=Healthline%20Networks', 'taylormadetraffic.com', NULL, 'Dashboard is an all-in-one Content-Management-System, Reporting, and Ad Configuration tool. It controls where, when and why to inject ads or content in webpages. It also allows reviewing Navigator, healthSTAT, and the internal crawler\'s performance across various installations.', 'en', 'debug', NULL, 1473210995, '2016-09-07 01:16:35'),
(706, 'ul                    lidashboard aids in debugging of the relevance of selected keywords to a page it also provides the crawler additional controls for prioritizing areas of the page to parse skip and flag for injection or interlinking li                    lithrough dashboard you can rebuild any webpage within a proxy environment on healthline servers in order to install test and demonstrate navigation functionality on any urlli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/companies?qtfilter=Healthline%20Networks', 'taylormadetraffic.com', NULL, '<ul>\r\n                    <li>Dashboard aids in debugging of the relevance of selected keywords to a page. It also provides the crawler additional controls for prioritizing areas of the page to parse, skip, and flag for injection or inter-linking .</li>\r\n                    <li>Through Dashboard you can rebuild any webpage within a proxy environment on Healthline servers in order to install, test, and demonstrate Navigation functionality on any URL</li>\r\n                </ul>', 'en', 'debug', NULL, 1473210995, '2016-09-07 01:16:35'),
(707, 'ul                    lia google chrome extension and browserbased crawler to automate qa of web pages after all ads and third party javascripts have completely loadedli                    libuilds automated reports on how pages are categorized by many different engines and apis while tracking the web of links between each page everything is stored in sqlite localstorage via lawnchair ex healthlinecomcorporatenavigatorstagecrawlerhtmldomainsharecare  or domainhealthline both take a while to load all 30k rowsli                    litakes jpg screenshots of every page crawled it can also first render watermarks and set colored borders around each area of that page where navigator might inject an adli                ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/companies?qtfilter=Healthline%20Networks', 'taylormadetraffic.com', NULL, '<ul>\r\n                    <li>A Google Chrome Extension and browser-based Crawler to automate QA of web pages after all ads and third party javascripts have completely loaded.</li>\r\n                    <li>Builds automated reports on how pages are categorized by many different engines and APIs, while tracking the web of links between each page. Everything is stored in SQLite LocalStorage via Lawnchair. Ex. healthline.com/corporate/navigator/stage/crawler.html?domain=sharecare  or ?domain=healthline (both take a while to load all 30K rows)</li>\r\n                    <li>Takes .jpg screenshots of every page crawled. It can also first render watermarks and set colored borders around each area of that page where Navigator might inject an ad.</li>\r\n                </ul>', 'en', 'debug', NULL, 1473210995, '2016-09-07 01:16:35'),
(708, 'the business requirements insisted that the tool be distributable as a single selfcontained file which could be easily reskinned for other brands it was not clear if their target devices would run java applets but certain they had browsers with flash so we used flex and as3', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/companies?qtfilter=Healthline%20Networks', 'taylormadetraffic.com', NULL, 'The business requirements insisted that the tool be distributable as a single self-contained file which could be easily reskinned for other brands. It was not clear if their target devices would run Java Applets, but certain they had browsers with Flash, so we used Flex and AS3.', 'en', 'debug', NULL, 1473210995, '2016-09-07 01:16:35'),
