(711, 'ullibuilt a fluid interface fully responsive from 320 to 1024 pixels wide without a page refresh with html5 and css3liliscripted all api integrations with javascript and phplilideployed the mobile application through cordova and nodejs plugins to quickly configure compress and compile mobile applications for android and iosliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built a fluid interface, fully responsive from 320 to 1024+ pixels wide, without a page refresh, with HTML5 and CSS3</li>\n<li>Scripted all API integrations with JavaScript and PHP.</li>\n<li>Deployed the mobile application through Cordova and Node.js plugins to quickly configure, compress, and compile mobile applications for Android and iOS.</li>\n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(712, 'ulliengineered mvc architecture for dual website  api using codeignitor and hmvc modular extensions to allow complex types of permission combinations across user types and make all components completely portable across applications serving either html or jsonlilioptimized memory usage with several bash scripts and cron jobs to crop  resize images handle email queues and generate static html pages for common anonymous requestslilibuilt cms for managing usergenerated and editorial content review internal traffic logs logins and all emails lilibuilt asynchronous email service to seamlessly convert website templates to tablular html documents with inline css and manage queue of emails prepared sent failed and clickedliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Engineered MVC architecture for dual website / API using CodeIgnitor and HMVC Modular Extensions, to allow complex types of permission combinations across user types, and make all components completely portable across applications, serving either HTML or JSON.</li>\n<li>Optimized memory usage with several Bash scripts and CRON jobs to crop / resize images, handle email queues, and generate static HTML pages for common anonymous requests.</li>\n<li>Built CMS for managing user-generated and editorial content, review internal traffic logs, logins, and all emails. </li>\n<li>Built asynchronous email service to seamlessly convert website templates to tablular HTML documents with inline CSS, and manage queue of emails prepared, sent, failed, and clicked.</li>\n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(713, 'blingby lets users live the experience of their favorite music videos and movie trailers blingby llc tags topvoted youtube videos with purchase links so products hotels and artists are shown insync as the video plays', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 136, '/eli', 'taylormadetraffic.com', NULL, 'Blingby lets users \'live the experience\' of their favorite music videos and movie trailers. Blingby LLC tags top-voted YouTube videos with purchase links so products, hotels, and artists are shown in-sync as the video plays.', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(714, 'ulliconfigured and hooked drupal views to query content internally and from amazon for album artwork as well as youtube for matching videoslilirebuilt drupal templates for a more responsive experience across devices with css3lilideveloped googlemap interface and query logic to reorder of ad  affiliates links based on the users location and affiliates geographic settingslilibuilt several administrative tools for configuring home page settings photo carousels and reviewing dataintegrity from error logs and drupals urlalias tableli ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Configured and hooked Drupal Views to query content internally and from Amazon for album artwork as well as YouTube for matching videos.</li>\n<li>Rebuilt Drupal templates for a more responsive experience across devices with CSS3</li>\n<li>Developed google-map interface and query logic to re-order of ad / affiliates\' links based on the user\'s location and affiliates’ geographic settings.</li><li>Built several administrative tools for configuring home page settings, photo carousels, and reviewing data-integrity from error logs and Drupal’s url_alias table.</li> \n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(715, 'tags map manytomany and are used by the global search box types map 1tomany and are used by the main drawer menus selectable filters', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 136, '/eli', 'taylormadetraffic.com', NULL, 'Tags map many-to-many and are used by the global search box, Types map 1-to-many and are used by the main drawer menu\'s selectable filters.', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(716, 'ullideveloped scraper tool for importing airport data from html json and rss feedsliliautomated and improved categorization  despite an insufficient taxonomy  by learning from the full text of previous importslilibuilt batch processing tool to review and update importer decisions by tagging content to effect tag weights to a primary typeliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Developed scraper tool for importing Airport data from HTML, JSON, and RSS feeds.</li>\n<li>Automated and improved categorization - despite an insufficient taxonomy - by learning from the full text of previous imports.</li>\n<li>Built batch processing tool to review and update importer decisions by tagging content to effect Tag weights to a primary Type.</li>\n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(717, 'ullibuilt a fluid interface fully responsive from 320 to 1024 pixels wide without a page refresh with html5 and css3liliscripted all api integrations with javascript  jquery parsing html and json from the drupal server and across domains and thirdparty web serviceslilideployed the mobile application through cordova and nodejs plugins to quickly configure compress and compile the android apkliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built a fluid interface, fully responsive from 320 to 1024+ pixels wide, without a page refresh, with HTML5 and CSS3</li>\n<li>Scripted all API integrations with JavaScript / jQuery, parsing HTML and JSON from the Drupal server and across domains and third-party web services.</li>\n<li>Deployed the mobile application through Cordova and Node.js plugins to quickly configure, compress, and compile the Android APK.</li>\n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(718, 'ullibuilt oauth2 token secured cms  api with drupal 7lilihooked drupal views to set default filters based users profiles location next flight information liliintegrated flightstats api at runtime while adding or editing flight informationlilioptimized site and api with cron jobs to update flight status and real time airport details from flightstats apiliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built OAuth2, token secured CMS & API with Drupal 7</li>\n<li>Hooked Drupal Views to set default filters based users\' profiles, location, next flight information. </li>\n<li>Integrated FlightStats API at runtime while adding or editing flight information.</li>\n<li>Optimized site and API with CRON jobs to update flight status and real time airport details from FlightStats API</li>\n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(719, 'id interactive builds marketing platforms for a long list of great clients with creative projects and campaigns this was just one of the projects i got to build while working there view more projects i built with id interactive here httptaylormadetrafficcomcompaniesqtfilterid20interactive', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 136, '/eli', 'taylormadetraffic.com', NULL, 'ID interactive builds marketing platforms for a long list of great clients with creative projects and campaigns. This was just one of the projects I got to build while working there. View more projects I built with ID Interactive here: http://taylormadetraffic.com/companies?qtfilter=ID%20Interactive', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(720, 'ullibuilt responsive interface pixel perfect to design specs with elegant clientside form validation using html5 css3 and pure javascriptliliwrote barcode queries and prize distribution algorithm to evenly distribute 285 prizes without predefined winners across the 60 day campaign against 20 million codes printed on oreo packages throughout colombia supported business rules such as captcha when a user searched more than 12 times in a dayliliincluded several backend tracking tools for reviewing code attempts and wins as well as an automated qa tester to simulate varying degrees of traffic code searches and minimum probabilitiesliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built responsive interface, pixel perfect to design specs, with elegant client-side form validation using HTML5, CSS3 and pure JavaScript.</li>\n<li>Wrote barcode queries and prize distribution algorithm to evenly distribute 285 prizes, without predefined winners, across the 60 day campaign, against 20 million codes printed on Oreo packages throughout Colombia. Supported business rules such as Captcha when a user searched more than 12 times in a day.</li>\n<li>Included several backend tracking tools for reviewing code attempts and wins, as well as an automated QA tester to simulate varying degrees of traffic, code searches, and minimum probabilities.</li>\n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(721, 'the tool automates monthly reports for clients by aggregating data from all active marketing channels or installed tracking tools such as twitter facebook insights google analytics and youtube', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 136, '/eli', 'taylormadetraffic.com', NULL, 'The tool automates monthly reports for clients, by aggregating data from all active marketing channels or installed tracking tools, such as Twitter, Facebook Insights, Google Analytics, and YouTube.', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(722, 'ullibuilt fluid interface of draganddroppable graphs for project managers to create monthly performance reports of client campaignslilibuilt api to customize each graph with comments unique headers colors sizes and display orders before generating shareable urls to produce reports across accounts or without loginlilibuilt site permissions matrix for view write and delete privileges limited per user client brand and projectlilimodularized graph components to build and refresh off a normalized json structure produced onload and via ajax further allowing data drilling on all metrics and dimensionsliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built fluid interface of drag-and-droppable graphs for Project Managers to create monthly performance reports of client campaigns.</li>\n<li>Built API to customize each graph with comments, unique headers, colors, sizes, and display orders before generating shareable URLs to produce reports across accounts or without login.</li>\n<li>Built site permissions matrix for view, write, and delete privileges limited per user, client, brand, and project.</li><li>Modularized graph components to build and refresh off a normalized JSON structure, produced on-load and via AJAX, further allowing data drilling on all metrics and dimensions.</li>\n</ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(723, 'ullibuilt crossdomain script tag used to inject contextual ads content and seo hyperlinks onto any web page from 79 kilobytes of pure javascriptlilisupported up to 60 requests per second including tracking pixels and over 50000 sql inserts batched daily through an asynchronous sql loader clients included healthlinecom sharecarecom healthyahoonet and otherslilibuilt a clientside keyword scanner to select terms from common semantic rules or other adtags running simultaneously allowing contextual advertising services without a backend processorliliautomated appropriate ad placement via dom scanner to measure elements dimensions amount of text and tag structure when explicit placement rules were not found in the healthline dashboard described belowlili', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built cross-domain script tag used to inject contextual ads, content, and SEO hyper-links onto any web page from 79 kilobytes of pure JavaScript.</li>\n<li>Supported up to 60 requests per second including tracking pixels and over 50,000 SQL inserts batched daily through an asynchronous SQL loader. (Clients included healthline.com, sharecare.com, health.yahoo.net, and others)</li>\n<li>Built a client-side keyword scanner to select terms from common semantic rules or other ad-tags running simultaneously; allowing contextual advertising services without a backend processor.</li>\n<li>Automated appropriate ad placement via DOM scanner to measure element\'s dimensions, amount of text, and tag structure when explicit placement rules were not found in the Healthline Dashboard described below.</li>\n</li>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(724, 'ullibuilt this dashboard to provide the crawler additional controls for prioritizing areas of the page to parse skip and flag for injection or interlinking with java  spring and oraclesqllilibuilt tool to rebuild any webpage within a proxy environment on healthline servers in order to install test and demonstrate navigation functionality on any urllilioptimized crawlers queue to more efficiently check for content changes ignoring irrelevant differences in the dom source liliimproved backend healthstat crawlers keyword selections with configurations per domain to prioritize url segments vs dom body vs dom meta data based on target sites semantic standardslili', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built this Dashboard to provide the crawler additional controls for prioritizing areas of the page to parse, skip, and flag for injection or inter-linking; with Java / Spring and Oracle/SQL.</li>\n<li>Built tool to rebuild any webpage within a proxy environment on Healthline servers in order to install, test, and demonstrate Navigation functionality on any URL.</li>\n<li>Optimized crawler’s queue to more efficiently check for content changes, ignoring irrelevant differences in the DOM source. </li><li>Improved backend healthSTAT crawler’s keyword selections with configurations per domain to prioritize URL segments vs. DOM Body vs. DOM meta data, based on target site’s semantic standards.</li>\n</li>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(725, 'ullibuilt this google chrome extension and browserbased crawler to automate qa of web pages after all ads and third party javascripts have completely loaded with pure javascript and sqlitelilimapped entire websites while tracking categorization choices by each different healthline and competingliliautomated jpg screen captures of every page crawled with options to first render watermarks and set colored borders around each area of that page where navigator might inject ads content or hyperlinksliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\n<li>Built this Google Chrome Extension and browser-based Crawler to automate QA of web pages after all ads and third party javascripts have completely loaded, with pure JavaScript and SQLite.</li>\n<li>Mapped entire websites while tracking categorization choices by each different Healthline and competing.</li>\n<li>Automated .jpg screen captures of every page crawled, with options to first render watermarks and set colored borders around each area of that page where Navigator might inject ads, content, or hyper-links.</li>\n<ul>', 'en', 'debug', NULL, 1476998795, '2016-10-20 21:26:35'),
(726, 'ulliengineered mvc architecture for dual website  api using codeignitor and hmvc modular extensions to allow complex types of permission combinations across user types and make all components completely portable across applications serving either html or jsonlilioptimized memory usage with several bash scripts and cron jobs to crop  resize images handle email queues and generate static html pages for common anonymous requestslilibuilt cms for managing usergenerated and editorial content review internal traffic logs logins and all emails lilibuilt asynchronous email service to seamlessly convert website templates to tablular html documents with inline css and manage queue of emails prepared sent failed and clickedlilibuilt nodejs server to authenticate requests to static mp3 files before streaming via ffluentffmpegliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 137, '/eli', 'taylormadetraffic.com', NULL, '<ul>\r\n<li>Engineered MVC architecture for dual website / API using CodeIgnitor and HMVC Modular Extensions, to allow complex types of permission combinations across user types, and make all components completely portable across applications, serving either HTML or JSON.</li>\r\n<li>Optimized memory usage with several Bash scripts and CRON jobs to crop / resize images, handle email queues, and generate static HTML pages for common anonymous requests.</li>\r\n<li>Built CMS for managing user-generated and editorial content, review internal traffic logs, logins, and all emails. </li>\r\n<li>Built asynchronous email service to seamlessly convert website templates to tablular HTML documents with inline CSS, and manage queue of emails prepared, sent, failed, and clicked.</li>\r\n<li>Built Node.js server to authenticate requests to static mp3 files before streaming via ffluent-ffmpeg</li>\r\n</ul>', 'en', 'debug', NULL, 1477353011, '2016-10-24 23:50:11');
