(775, 'ul  libuilt interface to configure assembly jobs and control machinary over websocketsli  listructured interface for offlinefirst activity allowing jobs to continue manually but still presenting screw order and tracking process in local storageli  libuilt clientside performance tracker averaging the time to assemble one project in a jobli  licreated custom nodered nodes for smoother synchronization with fanuc robotsli  liwrote strict data validation to check torque and resistance values after each fastener stored value in remote mysql database and only preceed on passesliul', 'ugc', '/Users/user/Developer/tmt/TaylorMadeTraffic-CL/application/views/projects_table.php', 140, '/eli', 'localhost.taylormadetraffic.com', NULL, '<ul>\n  <li>Built interface to configure assembly jobs and control machinary over WebSockets</li>\n  <li>Structured interface for offline-first activity, allowing jobs to continue manually but still presenting screw order and tracking process in Local Storage.</li>\n  <li>Built client-side performance tracker averaging the time to assemble one project in a job</li>\n  <li>Created custom node-red nodes for smoother synchronization with Fanuc robots</li>\n  <li>Wrote strict data validation to check torque and resistance values after each fastener, stored value in remote mySQL database, and only preceed on passes</li>\n</ul>\n', 'en', 'debug', NULL, 1583879976, '2020-03-10 22:39:36'),
