\n<ul>\n  <li>Built single codebase to compile multiple custom branded versions of the application for different domains (~500KB compressed / each). Supported functionality is determined by the Group Type.\n      <ul>\n          <li><a href=\"https://fantasytrackball.com\" target=\"_blank\">fantasytrackball.com</a></li>\n          <li><a href=\"http://rsoundtrack.com\" target=\"_blank\">rsoundtrack.com</a></li>\n          <li><a href=\"https://jetsetlovers.com\" target=\"_blank\">jetsetlovers.com</a></li>\n          <li><a href=\"https://thebeatbazaar.com/\" target=\"_blank\">thebeatbazaar.com</a></li>\n      </ul>\n  </li>\n  <li>Material-UI theme &amp; palette driven by CMS configurations making entire app reskinnable</li>\n  <li>Built form builder from field components to allow all order and text to be provided and translated by CMS</li>\n  <li>Wrote Redux store for optimal updates across the application without consuming excessive CPU</li>\n  <li>Designed and copywrote entire application, icons and logo, sometimes in California, sometimes abroad</li>\n</ul>\n\n<h2>Built all aspects API and CMS from a decoupled Drupal 8 architecture with mySQL</h2>\n<ul>\n  <li>API built with Drupal 8 and Symphony best practices leveraging the Cache API, dependency injection for services, factory utilities, entity normalizers.</li>\n  <li>Built CRUD routing paths dynamically from registered Entities and entity bundles</li>\n  <li>Built end-to-end functional testing suite to test all endpoints over creatively built CURL requests</li>\n  <li>Designed relational database schema for optimal performance and easy indexing\n  <li>Integrated GlobalPayments / Heatland Payment Gateway alongside Commerce Funds to process transactions and keep records of users \'wallet\' value</li>\n  <li>Wrote OAuth2 Authentication system to issue short and long term access token from the Password Grant via HTTP and encrypted OTP links</li>\n</ul>', 'en', 'debug', NULL, 1583888293, '2020-03-11 00:58:13'),
