(800, 'psoftware is just another tool i like to use to connect people and ideasmy programmatic passions tends to land on the creative frontend of product and interface development however i also take great interest in creating apis and discovery search systems against nosql or relational databases with complex taxonomieslately ive enjoyed using nodered to create iot solutions in automationp', 'ugc', '/Users/user/Developer/tmt/TaylorMadeTraffic-CL/application/views/user_profile.php', 36, '/eli', 'localhost.taylormadetraffic.com', NULL, '<p>\nSoftware is just another tool I like to use to connect people and ideas.\nMy programmatic passions tends to land on the creative front-end of product and interface development. \nHowever, I also take great interest in creating APIs and Discovery search systems against nosql or relational databases with complex taxonomies.\nLately, I\'ve enjoyed using node-red to create IoT solutions in automation.\n</p>', 'en', 'debug', NULL, 1583899490, '2020-03-11 04:04:50'),
