(851, 'ulliused react native redux and asyncstorage to create offlinefirst native applications for ios and android with persistent storage and network detection for gracefully handling session restores and database synchronization lilipreserved backward compatibility while adding and improving all features of the app including messaging safety notifications document sharing and downloads file uploadslilibuilt synchronous test suite for endtoend api testing as any userliliused reactjs with google chart api to build a variety of analytical charts on flight data with user controls for drilling on data and changing graph typesliul', 'ugc', '/Users/elitaylor/Developer/tmt/TaylorMadeTraffic-CL/application/views/projects_table.php', 155, '/eli', 'localhost.taylormadetraffic.com', NULL, '<ul>\n<li>Used React Native, Redux and AsyncStorage to create offline-first native applications for iOS and Android with persistent storage and network detection for gracefully handling session restores and database synchronization. </li>\n\n<li>Preserved backward compatibility while adding and improving all features of the app including Messaging, Safety Notifications, document sharing and downloads, file uploads.</li>\n\n<li>Built synchronous test suite for end-to-end API testing as any user.</li>\n\n<li>Used ReactJS with Google Chart API to build a variety of analytical charts on flight data with user controls for drilling on data and changing graph types.</li>\n</ul>', 'en', 'debug', NULL, 1636090078, '2021-11-05 05:27:58'),
(852, 'ulliscripted nodejs parser and cron job for transforming apache logs to stix2 bundles for importingliliextended opencti platform with custom python connector for filtering and importing log data as indicators observations and sightingslilibuilt react components to ease batch importing with predefined tags and expose searchable data tables of imported data using graphqlliliwrote custom enrichment connectors to categorize and group log data as campaignslilicurrently building out analysis tools to categorize log data as attack patterns and to identify threat actors through various inference engine rulesliul', 'ugc', '/Users/elitaylor/Developer/tmt/TaylorMadeTraffic-CL/application/views/project_profile.php', 13, '/projects?pid=56', 'localhost.taylormadetraffic.com', NULL, '<ul><li>Scripted NodeJS parser and cron job for transforming Apache logs to Stix2 bundles for importing.</li>\n<li>Extended OpenCTI platform with custom python connector for filtering and importing log data as Indicators, Observations, and Sightings.</li>\n<li>Built React components to ease batch importing with predefined tags and expose searchable data tables of imported data using GraphQL.</li>\n<li>Wrote custom enrichment connectors to categorize and group log data as Campaigns.</li>\n<li>Currently building out analysis tools to categorize log data as Attack Patterns and to identify Threat Actors through various inference engine rules.</li></ul>', 'en', 'debug', NULL, 1636090079, '2021-11-05 05:27:59'),
(853, 'ray allen', 'msg', '/Users/elitaylor/Developer/tmt/TaylorMadeTraffic-CL/application/views/projects_table.php', 39, '/eli', 'localhost.taylormadetraffic.com', NULL, NULL, 'en', 'debug', NULL, 1636090148, '2021-11-05 05:29:08'),
(854, 'ul    lirebuilt opencti interface to follow streamlined workflow to control ingestion triage alerts and fine tune ml engine analysisli    li        wrote all parsers for transforming emails and various log formats into appropriate stix2 objects    li    li        built ingestion system to support custom configurations and toggle persistent storage of observables while preserving analysis and prediction with or without historical data    li    li        wrote test cases and reproducible pen test with zap security scanner to validate performance processing and predictions    li    li        used stix2 antlr4 grammar for pattern matching log data with existing indicators of compromise    li    li        leveraged inference engine settings to automated indirect relationships between different stix objects    liul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 155, '/eli', 'taylormadetraffic.com', NULL, '<ul>\r\n    <li>Rebuilt OpenCTI interface to follow streamlined workflow to control ingestion, triage alerts and fine tune ML engine analysis</li>\r\n    <li>\r\n        Wrote all parsers for transforming emails and various log formats into appropriate STIX2 objects\r\n    </li>\r\n    <li>\r\n        Built ingestion system to support custom configurations and toggle persistent storage of Observables while preserving analysis and prediction with or without historical data.\r\n    </li>\r\n    <li>\r\n        Wrote test cases and reproducible pen test with ZAP Security Scanner to validate performance, processing and predictions.\r\n    </li>\r\n    <li>\r\n        Used Stix2 ANTLR4 grammar for pattern matching log data with existing Indicators of Compromise\r\n    </li>\r\n    <li>\r\n        Leveraged inference engine settings to automated indirect relationships between different Stix objects\r\n    </li>\r\n</ul>', 'en', 'debug', NULL, 1681893972, '2023-04-19 08:46:12'),
(855, 'h3built all aspects of reactjs responsive web app with redux and materialuih3ul    libuilt single codebase to compile different applications with unique branding themes and functionality for examples see        ul            li stylemargintop 0liststyle initiala hrefhttpsfantasytrackballcom targetblanktheraprulercoma            li            li stylemargintop 0liststyle initiala hrefhttpsfantasytrackballcom targetblankfantasytrackballcoma            li            li stylemargintop 0liststyle initiala hrefhttpsjetsetloverscom targetblankjetsetloverscoma            li            li stylemargintop 0liststyle initiala hrefhttpsthebeatbazaarcom targetblankthebeatbazaarcoma            li            li stylemargintop 0liststyle initiala hrefhttpsrsoundtrackcomest targetblankrsoundtrackcomesta            li        ul    li    liwrote abstract form builder to render any layout and set of field componentsli    liwrote cypressio test suite using typescript and nodejs to generate unique endtoend tests for each brand each with 3 device sizes also wrote ffmpeg script to crop and repurpose cypress recordings as howto  demo videosli    lidesigned and copywrote entire application icons and logo sometimes in california sometimes abroadliulh3built all aspects api and cms from a decoupled drupal 8 architecture with mysqlh3ul    liapi built with php around drupal 9 and symfony leveraging the cache api and dependency injection for        services query factory and entity normalizers    li    libuilt crud routing paths dynamically from registered entities and entity bundlesli    libuilt endtoend functional testing suite to test all endpoints over curl requestsli    liintegrated cloud9 gateway alongside commerce funds to process transactions and keep records of users wallet valueli    liwrote oauth2 authentication system to issue short and long term access token from the password grant via http and encrypted otp linksli    liwrote email blast tools for group owners to send otp links to existing and new users safely and securelyliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 155, '/eli', 'taylormadetraffic.com', NULL, '<h3>Built all aspects of ReactJS responsive web app with Redux and Material-UI</h3>\r\n<ul>\r\n    <li>Built single codebase to compile different applications with unique branding, themes and functionality. For examples, see\r\n        <ul>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://fantasytrackball.com\" target=\"_blank\">therapruler.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://fantasytrackball.com\" target=\"_blank\">fantasytrackball.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://jetsetlovers.com\" target=\"_blank\">jetsetlovers.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://thebeatbazaar.com/\" target=\"_blank\">thebeatbazaar.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://rsoundtrack.com/est\" target=\"_blank\">rsoundtrack.com/est</a>\r\n            </li>\r\n        </ul>\r\n    </li>\r\n    <li>Wrote abstract form builder to render any layout and set of field components.</li>\r\n    <li>Wrote Cypress.io Test Suite using TypeScript and NodeJS to generate unique end-to-end tests for each brand, each with 3 device sizes. Also wrote FFMpeg script to crop and repurpose Cypress recordings as HowTo / demo videos.</li>\r\n    <li>Designed and copywrote entire application, icons and logo, sometimes in California, sometimes abroad</li>\r\n</ul>\r\n\r\n<h3>Built all aspects API and CMS from a decoupled Drupal 8 architecture with mySQL</h3>\r\n<ul>\r\n    <li>API built with PHP around Drupal 9 and Symfony, leveraging the Cache API and dependency injection for\r\n        services, query factory, and entity normalizers.\r\n    </li>\r\n    <li>Built CRUD routing paths dynamically from registered Entities and entity bundles</li>\r\n    <li>Built end-to-end functional testing suite to test all endpoints over CURL requests</li>\r\n    <li>Integrated Cloud9 Gateway alongside Commerce Funds to process transactions and keep records of users \'wallet\' value</li>\r\n    <li>Wrote OAuth2 Authentication system to issue short and long term access token from the Password Grant via HTTP and encrypted OTP links</li>\r\n    <li>Wrote Email Blast tools for Group owners to send OTP links to existing and new users safely and securely.</li>\r\n</ul>', 'en', 'debug', NULL, 1681896371, '2023-04-19 09:26:11'),
