(862, 'h3built frontend and backend of pickupmvpcomh3ul    liwrote absractions to support groups within groups while inheriting publish and privacy settings from parent groupli    liadded customized checkout process to require release of liability agreementli    liextended ecommerce system to allow draft orders and entrance fee payments of upcoming matchesli    lienhanced tam permissions matrix to allow connecting music playlists from other groups as background music for upcoming matchli    libuilt flutter webview wrapper to publish as mobile app in app store and google playliul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 155, '/eli', 'www.taylormadetraffic.com', NULL, '<h3>Built front-end and backend of PickupMVP.com</h3>\r\n<ul>\r\n    <li>Wrote absractions to support Groups within Groups while inheriting publish and privacy settings from parent group</li>\r\n    <li>Added customized Checkout process to require Release of Liability agreement</li>\r\n    <li>Extended e-commerce system to allow draft orders and entrance fee payments of upcoming matches</li>\r\n    <li>Enhanced TAM permissions matrix to allow connecting music playlists from other groups as background music for upcoming match.</li>\r\n    <li>Built Flutter WebView wrapper to publish as mobile app in App Store and Google Play</li>\r\n</ul>', 'en', 'debug', NULL, 1681899692, '2023-04-19 10:21:32'),
