(867, 'h3built frontend backend and ai for pickupmvpcomh3        ul            liwrote abstractions for track authority music tam to support groups within groups while inheriting                publish and privacy settings from parent group            li            liadded customized checkout process to require release of liability agreementli            liextended ecommerce system to allow draft orders and entrance fee payments of upcoming matchesli            lienhanced tam permissions matrix to allow connecting music playlists from other groups as background                music for upcoming match            li            libuilt flutter webview wrapper to publish as mobile app in app store and google playli            litrained a neural net model for detecting balls and players in video recordingsli            liwrote all business logic for object tracking and isolating the clips subject athelete and ballli            libuilt predictions review and feedback interface to allow additional tagging and fine tuningli            liconfigured all server architecture to store clips on a mounted disk outside of the runtime vmli        ul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 155, '/eli', 'taylormadetraffic.com', NULL, '<h3>Built front-end, backend, and AI for PickupMVP.com</h3>\r\n        <ul>\r\n            <li>Wrote abstractions for Track Authority Music (TAM) to support Groups within Groups while inheriting\r\n                publish and privacy settings from parent group\r\n            </li>\r\n            <li>Added customized Checkout process to require Release of Liability agreement</li>\r\n            <li>Extended e-commerce system to allow draft orders and entrance fee payments of upcoming matches</li>\r\n            <li>Enhanced TAM permissions matrix to allow connecting music playlists from other groups as background\r\n                music for upcoming match.\r\n            </li>\r\n            <li>Built Flutter WebView wrapper to publish as mobile app in App Store and Google Play</li>\r\n            <li>Trained a neural net model for detecting Balls and Players in video recordings</li>\r\n            <li>Wrote all business logic for Object Tracking and isolating the clip\'s subject athelete and ball</li>\r\n            <li>Built predictions review and feedback interface to allow additional tagging and fine tuning</li>\r\n            <li>Configured all server architecture to store clips on a mounted disk outside of the runtime VM</li>\r\n        </ul>', 'en', 'debug', NULL, 1692063667, '2023-08-15 01:41:07'),
