(873, 'div classtechnotesh3built frontend backend and ai for pickupmvpcomh3        ul            litrained a neural net model for detecting balls players and goals in video recordings of 4 different sportsli            liwrote all business logic for object tracking and isolating the clips subject athlete and ballli            liwrote abstractions for track authority music tam to support groups within groups while inheriting                publish and privacy settings from parent group            li            liadded customized checkout process to require release of liability agreementli            liextended ecommerce system to allow draft orders and entrance fee payments of upcoming matchesli            lienhanced tam permissions matrix to allow connecting music playlists from other groups as background                music for upcoming match            li            libuilt flutter webview wrapper to publish as mobile app in app store and google playli            libuilt predictions review and feedback interface to allow additional tagging and fine tuningli            liconfigured all server architecture to store clips on a mounted disk outside the runtime vmli        ul    div', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 155, '/eli', 'taylormadetraffic.com', NULL, '<div class=\"technotes\"><h3>Built front-end, backend, and AI for PickupMVP.com</h3>\r\n        <ul>\r\n            <li>Trained a neural net model for detecting balls, Players, and goals in video recordings of 4 different sports</li>\r\n            <li>Wrote all business logic for Object Tracking and isolating the clip\'s subject athlete and ball</li>\r\n            <li>Wrote abstractions for Track Authority Music (TAM) to support Groups within Groups while inheriting\r\n                publish and privacy settings from parent group\r\n            </li>\r\n            <li>Added customized Checkout process to require Release of Liability agreement</li>\r\n            <li>Extended e-commerce system to allow draft orders and entrance fee payments of upcoming matches</li>\r\n            <li>Enhanced TAM permissions matrix to allow connecting music playlists from other groups as background\r\n                music for upcoming match.\r\n            </li>\r\n            <li>Built Flutter WebView wrapper to publish as mobile app in App Store and Google Play</li>\r\n            <li>Built predictions review and feedback interface to allow additional tagging and fine tuning</li>\r\n            <li>Configured all server architecture to store clips on a mounted disk outside the runtime VM</li>\r\n        </ul>\r\n    </div>', 'en', 'debug', NULL, 1703466046, '2023-12-25 01:00:46'),
(874, 'ul    li        wrote all parsers for transforming emails and various log formats into appropriate stix2 objects    li    li        built customizable log ingestion system with basic runtime threat analysis to score and store relevant meta data as stix2 objects while preserving context and source maps    li    li        used stix2 antlr4 grammar for pattern matching log data with existing indicators of compromise ioc    li    li        used zap security scanner to pen test company domains with attack ids in request headers then wrote generic ioc patterns based on signatures seen in logs during pen test    li    li        wrote opinions api to allow analysts to score iocs by vulnerability and severity scales separately    li    libuilt atop opencti interface to follow streamlined workflow to control ingestion triage alerts and fine tune ml        engine analysis    liul', 'ugc', '/homepages/22/d188812746/htdocs/taylormade/prod_m02/application/views/projects_table.php', 155, '/eli', 'taylormadetraffic.com', NULL, '<ul>\r\n    <li>\r\n        Wrote all parsers for transforming emails and various log formats into appropriate STIX2 objects\r\n    </li>\r\n    <li>\r\n        Built customizable log ingestion system with basic runtime threat analysis to score and store relevant meta data as Stix2 objects while preserving context and source maps.\r\n    </li>\r\n    <li>\r\n        Used Stix2 ANTLR4 grammar for pattern matching log data with existing Indicators of Compromise (IoC)\r\n    </li>\r\n    <li>\r\n        Used ZAP Security Scanner to pen test company domains with attack IDs in request headers. Then wrote generic IoC Patterns based on signatures seen in logs during pen test.\r\n    </li>\r\n    <li>\r\n        Wrote Opinions API to allow analysts to score IoCs by \'vulnerability\' and \'severity\' scales separately.\r\n    </li>\r\n    <li>Built atop OpenCTI interface to follow streamlined workflow to control ingestion, triage alerts and fine tune ML\r\n        engine analysis\r\n    </li>\r\n</ul>\r\n', 'en', 'debug', NULL, 1703466046, '2023-12-25 01:00:46');
