(9, 'tagged', 'development', '2012-12-01', '2013-12-01', 2012, 2013, 'Lenguaplus', '', NULL, 'analytics.idinteractive.co/lenguaplus/tutorial', NULL, 'TaylorMadeTraffic', 'TaylorMadeTraffic', NULL, 'PHP, mySQL, CodeIgniter, Google APIs', 'language', 'TaylorMadeTraffic', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End', 'Includes 8 configuration for tracking and translating system text and user-generated-content by environment and language', 'Lenguaplus is a plug-in for CodeIgniter that manages translations of system copy and user-generated content. It was built within Track Authority, this site, and extended for ID Interactive\'s Dashboard project in order to version control text changes by authorized user/authors', NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'tagged', 'development', '2013-05-01', NULL, 2013, 0, 'LealtadCard', '', NULL, NULL, NULL, 'TaylorMadeTraffic', 'TaylorMadeTraffic', NULL, 'Native Android SDK, Java, Facebook Graph API, Chord Framework, All-Share Framework', 'ecommerce, marketing, analytics', 'TaylorMadeTraffic', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End. <a href=\'/team?qtfilter= Sam Taylor\'> Sam Taylor</a>: Business Development', 'The promotions could be sent via SMS or Galaxy\'s Chord Framework. The interface and CMS is still in development', 'Lealtad card is a tool for independent retailers to publish and track promotions, along with their returned value and cost. For consumers, LealtadCard provides a way to search nearby promotions and publish their own controlled requests for good deals.', '<em>A virtual marketplace for independent retailers to publish and track promotions, along with their return-on-investment (ROI).</em>\n                    <p>Customers can search promotions and publish their own requests to nearby retailers for special deals. The marketplace is focused on private offers only valid for a few hours.</p>', '<ul class=\'alphalist\'>\n                            <li>$1/month for store owners to view customers data and analytics</li>\n                            <li>$1/month for store owners to send 100 private discount offers per month</li>\n                            <li>$1/month for store owners to public 10 public market ads per month</li>\n                            <li>Design &amp; Development services for more engaging mobile ads and promotions</li>\n                            <li>Build interactive and engaging maps for malls</li>\n                        </ul>', '<ul class=\'expenselist\'>\n                            <li>15% design</li>\n                            <li>50% development</li>\n                            <li>25% sales</li>\n                            <li>10% hardware</li>\n                        </ul>', '<ul class=\'datelist\'>\n                            <li>6 months: virtual marketplace with promotional builder and search/publishing by GPS location</li>\n                            <li>1 year: in malls with maps and directory listings</li>\n                        </ul>', '<a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/lealtad/research/android-apps-loyalty-card.jpg\" data-fancybox-group=\"lealtadcard\" >\n                            <img src=\"/wwwroot/images/sites/lealtad/research/android-apps-loyalty-card_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>\n                        <a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/lealtad/research/citypoints.jpg\" data-fancybox-group=\"lealtadcard\" >\n                            <img src=\"/wwwroot/images/sites/lealtad/research/citypoints_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>', NULL),
(11, 'tagged', 'development', '2012-11-01', '2013-01-01', 2012, 2013, 'Track Authority - CodeIgniter Website / API', '', 'http://trackauthoritymusic.com', NULL, NULL, 'TaylorMadeTraffic', 'Track Authority Music', NULL, 'PHP, CodeIgniter, mySQL, HTML5, CSS3, JavaScript, Bash, Facebook Graph API, Node.js, Express.js', 'music, events, gaming', 'TaylorMadeTraffic, Track Authority Music', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End, Business Development. <a href=\'/team?qtfilter=Drew Williams\'>Drew Williams</a>: Business Development', '<ul>\r\n<li>Engineered MVC architecture for dual website / API using CodeIgnitor and HMVC Modular Extensions, to allow complex types of permission combinations across user types, and make all components completely portable across applications, serving either HTML or JSON.</li>\r\n<li>Optimized memory usage with several Bash scripts and CRON jobs to crop / resize images, handle email queues, and generate static HTML pages for common anonymous requests.</li>\r\n<li>Built CMS for managing user-generated and editorial content, review internal traffic logs, logins, and all emails. </li>\r\n<li>Built asynchronous email service to seamlessly convert website templates to tablular HTML documents with inline CSS, and manage queue of emails prepared, sent, failed, and clicked.</li>\r\n<li>Built Node.js server to authenticate requests to static mp3 files before streaming via ffluent-ffmpeg</li>\r\n<li>Automated performance testing with XHProf and data integrity tests with built in logging tools</li>\r\n</ul>', 'An online and mobile game that rewards high-rated users with free music, gift certificates, concert tickets and cash', '<em>An online and mobile game for music lovers to play, exchange, and reward musical taste.</em>\n                    <p>Highly rated users are rewarded with free music, gift certificates, concert tickets and cash from sponsors and partners</p>\n                    <p>The platform supports three ways to play and win. Each starts with a playlist theme, such as \'Rise And Shine\': Songs for My Alarm Clock.</p>\n                    <ul>\n                        <li>1. Group members enter a song that suits the theme</li>\n                        <li>2. Group members list and rate each other\'s songs</li>\n                        <li>3. After two weeks, the person who submitted the highest rated song wins</li>\n                    </ul>\n                    <p>This game can easily be incorporated as a promotional vehicle for concert tours. For example, if that alarm clock was Jay-Z\'s, the options are countless for prizes from tickets to backstage passes and all links during the competition promote the concert</p>', '<ul class=\'alphalist\'>\n                            <li>concert ticket re-sales (3-5% fee)</li>\n                            <li>$1 - $10 subscriptions to ad-free listening and extra playlist features</li>\n                            <li>Concert ticket promotions, advertising and sales</li>\n                        </ul>', '<ul class=\'expenselist\'>\n                            <li>15% design</li>\n                            <li>70% development</li>\n                            <li>10% sales</li>\n                            <li>5% accounting</li>\n                            <li>5% legal</li>\n                        </ul>', '<ul class=\'datelist\'>\n                            <li>6 months: mobile app &amp; site complete</li>\n                        </ul>', '<a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/ta/research/android-apps-music-games.jpg\" data-fancybox-group=\"trackauthority\" >\n                            <img src=\"/wwwroot/images/sites/ta/research/android-apps-music-games_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>', '<ul class=\'marketresearch\'>\n                            <li>NO online concert ticket vendors also support extensive music stations or playlists</li>\n                            <li>Concert Ticket sold 52 million (2011) - <a class=\'sourceLink\' href=\"http://www.statisticbrain.com/concert-ticket-sale-statistics/\" target=\"_blank\">source</a></li>\n                            <li>Concert Ticket Revenue 3.1 Billion USD (2011) - <a class=\'sourceLink\' href=\"http://www.statisticbrain.com/concert-ticket-sale-statistics/\" target=\"_blank\">source</a></li>\n                            <li>Pollstar lists 10,859 touring artists, 71,823 Events - <a class=\'sourceLink\' href=\"http://money.futureofmusic.org/how-many-musicians-are-there/\" target=\"_blank\">source</a></li>\n                            <li><a href=\"http://musicbrainz.org/statistics\" target=\'_blank\'>musicbrainz.org/statistics</a></li>\n                            <li><a class=\'sourceLink\' href=\"http://www.ascap.com/about/\" target=\"_blank\">ASCAP</a>: 435,000 composters, songwriters, music publishers</li>\n                            <li><a class=\'sourceLink\' href=\"http://www.bmi.com/about\" target=\"_blank\">BMI</a>: 500,000 composters, songwriters, music publishers</li>                            \n                        </ul>'),
(12, 'current', 'development', '2013-07-01', '2013-12-01', 2013, 2013, 'ID Dashboard', '', 'http://analytics.idinteractive.co', NULL, NULL, 'ID Interactive', 'ID Interactive', NULL, 'PHP, CodeIgniter, mySQL, AJAX, JavaScript, Google Visualization API, Facebook Graph API, YouTube API, Twitter API, Laraval, CSS3, HTML5', 'analytics', 'ID Interactive', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End. <a href=\'/team?qtfilter=Juan Ruiz\'>Juan Ruiz</a>: Business Development. <a href=\'/team?qtfilter=Claudia Huertas\'>Claudia Huertas</a>: Business Development. <a href=\'/team?qtfilter=Alejandra Farfan\'>Alejandra Farfan</a>: Project Management. <a href=\'/team?qtfilter=David Duran\'>David Duran</a>: Project Management. <a href=\'/team?qtfilter=John Parra\'>John Parra</a>: QA. <a href=\'/team?qtfilter=Mauricio Zambrano\'>Mauricio Zambrano</a>: UX. <a href=\'/team?qtfilter=Catalina Molina\'>Catalina Molina</a>: UX', '<ul>\n<li>Built fluid interface of drag-and-droppable graphs for Project Managers to create monthly performance reports of client campaigns.</li>\n<li>Built API to customize each graph with comments, unique headers, colors, sizes, and display orders before generating shareable URLs to produce reports across accounts or without login.</li>\n<li>Built site permissions matrix for view, write, and delete privileges limited per user, client, brand, and project.</li><li>Modularized graph components to build and refresh off a normalized JSON structure, produced on-load and via AJAX, further allowing data drilling on all metrics and dimensions.</li>\n</ul>', 'The tool automates monthly reports for clients, by aggregating data from all active marketing channels or installed tracking tools, such as Twitter, Facebook Insights, Google Analytics, and YouTube.', NULL, NULL, NULL, NULL, NULL, NULL),
(13, 'tagged', 'development', '2013-06-01', '2013-07-01', 2013, 2013, 'Sedal Rizos', '', 'https://apps.facebook.com/sedalrizos/', 'http://fbtabs.imagendigital.co/unilever/sedal/surprise/', NULL, 'Sedal', 'ID Interactive', NULL, 'PHP, Slim Framework, mySQL, AJAX, JavaScript, Facebook Graph API', 'fashion, gaming', 'Sedal, ID Interactive', '<a href=\'/team?qtfilter=Zandro Gil\'>Zandro Gil</a>: Design.  <a href=\'/team?qtfilter=Luisa Vicaría Azuero\'>Luisa Vicaría Azuero</a>: Account Manager.  <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End.  <a href=\'/team?qtfilter=Fabian Mariño\'>Fabian Mariño</a>: Front-End.  <a href=\'/team?qtfilter=Natalia Uribe\'>Natalia Uribe</a>: Project Management.  <a href=\'/team?qtfilter=Jimmy Rodriguez\'>Jimmy Rodriguez</a>: QA', 'Another quick campaign application to generate FanPage likes. In order to compete, users were required to like Sedal\'s FanPage, complete registration, and upload videos, images, or a tip on maintaining their curly hair (ideally using Sedal products;). Voting was validated by IP, user agent, and session, while video uploads were POST\'d directly to a public YouTube channel using their PHP SDK. The project extended ID\'s fork of the Slim PHP Framework. I personally found more hurdles than helpers in the tightly namespaced codebase and it\'s odd use of closures for routing/controllers.', 'A curly-hair competition for a $250 shopping spree', NULL, NULL, NULL, NULL, NULL, NULL),
(14, 'current', 'development', '2013-11-01', '2013-12-01', 2013, 2013, 'Oreo Navidad', '', 'http://www.ganaoreo.com', NULL, NULL, 'Oreo', 'ID Interactive', NULL, 'PHP, mySQL, JavaScript', 'gaming', 'Oreo, ID Interactive', '<a href=\'/team?qtfilter=Cristopher Allen Lara\'>Cristopher Allen Lara</a>: Design. <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Oscar Gil\'>Oscar Gil</a>: Project Management. <a href=\'/team?qtfilter=Sharon Lewis\'>Sharon Lewis</a>: Account Manager. <a href=\'/team?qtfilter=Jimmy Rodriguez\'>Jimmy Rodriguez</a>: QA. <a href=\'/team?qtfilter=John Parra\'>John Parra</a>: QA', '<ul>\n<li>Built responsive interface, pixel perfect to design specs, with elegant client-side form validation using HTML5, CSS3 and pure JavaScript.</li>\n<li>Wrote barcode queries and prize distribution algorithm to evenly distribute 285 prizes, without predefined winners, across the 60 day campaign, against 20 million codes printed on Oreo packages throughout Colombia. Supported business rules such as Captcha when a user searched more than 12 times in a day.</li>\n<li>Included several backend tracking tools for reviewing code attempts and wins, as well as an automated QA tester to simulate varying degrees of traffic, code searches, and minimum probabilities.</li>\n</ul>', 'ID interactive builds marketing platforms for a long list of great clients with creative projects and campaigns. This was just one of the projects I got to build while working there. View more projects I built with ID Interactive here: http://taylormadetraffic.com/companies?qtfilter=ID%20Interactive', NULL, NULL, NULL, NULL, NULL, NULL),
(15, 'tagged', 'development', '2002-11-01', '2004-12-01', 2002, 2004, 'Collectiv LLC', '', 'http://www.collectiv.com/', 'http://www.collectiv.com/events.php', NULL, 'Collectiv LLC', 'Collectiv LLC', NULL, 'JavaScript, HTML, Photoshop, Illustrator', 'music, art, events', 'Collectiv LLC', '<a href=\'/team?qtfilter=Jamie Williams\'>Jamie Williams</a>: Design, Front-End, Back-End. <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End. <a href=\'/team?qtfilter=Eli Taylor\'>Eli Taylor</a>: Project Management. <a href=\'/team?qtfilter=Drew Williams\'>Drew Williams</a>: Project Management. <a href=\'/team?qtfilter=Tommy Goodwin\'>Tommy Goodwin</a>: Project Management', NULL, '<ul>\n                <li>The Collectiv was born in the summer of 2001 in Oakland, CA. Our organization was founded by A. Williams, aka Sokrates, with a mission to \"empower the Hip Hop community through education and entrepreneurship.\" We pursue this mission by sponsoring a diverse range of programs with distinct yet cooperative goals. We work with young entrepreneurs, activists and artists to design financially viable programs that will provide new opportunities for empowerment. We seek to create the perfect environment for turning an idea into impact.</li>\n                <li>The Collectiv currently sponsors three programs, Collectiv Records, Collectiv Arts &amp; Entertainment and Collectiv Foundation. Each of these programs occupies a distinct niche within the Hip Hop community.</li>\n                </ul>', NULL, NULL, NULL, NULL, NULL, NULL),
(16, 'current', 'development', '2009-05-01', '2012-07-01', 2009, 2012, 'Healthline Navigator', '', 'http://www.healthline.com/corporate/navigator/prod/demo.html', NULL, NULL, 'Healthline Networks', 'Healthline Networks', NULL, 'Java, Spring, Oracle, JavaScript', 'health, marketing', 'Healthline Networks', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End. <a href=\'/team?qtfilter=AJ Chen\'>AJ Chen</a>: Back-End. <a href=\'/team?qtfilter=Steve Jackson\'>Steve Jackson</a>: Back-End', '<ul>\n<li>Built cross-domain script tag used to inject contextual ads, content, and SEO hyper-links onto any web page from 79 kilobytes of pure JavaScript.</li>\n<li>Supported up to 60 requests per second including tracking pixels and over 50,000 SQL inserts batched daily through an asynchronous SQL loader. (Clients included healthline.com, sharecare.com, health.yahoo.net, and others)</li>\n<li>Built a client-side keyword scanner to select terms from common semantic rules or other ad-tags running simultaneously; allowing contextual advertising services without a backend processor.</li>\n<li>Automated appropriate ad placement via DOM scanner to measure element\'s dimensions, amount of text, and tag structure when explicit placement rules were not found in the Healthline Dashboard described below.</li>\n</li>', 'A Contextual Enrichment Tool of Rich-Media Health Information and Ads.', NULL, NULL, NULL, NULL, NULL, NULL),
(17, 'current', 'development', '2009-05-01', '2012-07-01', 2009, 2012, 'Healthline Dashboard', '', 'http://nav.healthline.com/healthstat/nav/dashboard/login', NULL, NULL, 'Healthline Networks', 'Healthline Networks', NULL, 'Java, Spring, Oracle, JavaScript, AJAX, jQuery Mobile', 'health, analytics, marketing', 'Healthline Networks', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End', '<ul>\n<li>Built this Dashboard to provide the crawler additional controls for prioritizing areas of the page to parse, skip, and flag for injection or inter-linking; with Java / Spring and Oracle/SQL.</li>\n<li>Built tool to rebuild any webpage within a proxy environment on Healthline servers in order to install, test, and demonstrate Navigation functionality on any URL.</li>\n<li>Optimized crawler’s queue to more efficiently check for content changes, ignoring irrelevant differences in the DOM source. </li><li>Improved backend healthSTAT crawler’s keyword selections with configurations per domain to prioritize URL segments vs. DOM Body vs. DOM meta data, based on target site’s semantic standards.</li>\n</li>', 'Dashboard is an all-in-one Content-Management-System, Reporting, and Ad Configuration tool. It controls where, when, and why to inject ads or content in webpages. It also allows reviewing Navigator, healthSTAT, and the internal crawler\'s performance across various installations.', NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'current', 'development', '2009-05-01', '2012-07-01', 2009, 2012, 'Healthline computeQA', '', 'http://www.healthline.com/corporate/navigator/prod/crawler.html?domain=healthline', NULL, NULL, 'Healthline Networks', 'Healthline Networks', NULL, 'WebSQL-lite, JavaScript, Google Chrome Extension, jQuery Mobile, LocalStorage', 'analytics', 'Healthline Networks', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End', '<ul>\r\n<li>Built this Google Chrome Extension and browser-based Crawler to automate QA of web pages after all ads and third party javascripts have completely loaded, with pure JavaScript and SQLite.</li>\r\n<li>Mapped entire websites while comparing keywords / categorization choices by each different Healthline API, as well as competing ad tags.</li>\r\n<li>Automated .jpg screen captures of every page crawled, with options to first render watermarks and set colored borders around each area of that page where Navigator might inject ads, content, or hyper-links.</li>\r\n<ul>', 'Automated Quality Assurance & Monitoring Through Interactive, Intelligent Browser-Based Crawling.', NULL, NULL, NULL, NULL, NULL, NULL),
(19, 'tagged', 'development', '2013-08-01', NULL, 2013, 0, 'Studio En Vivo', '', NULL, NULL, NULL, 'TaylorMadeTraffic', 'TaylorMadeTraffic', NULL, 'Native Android SDK, Java, Chord Framework, All-Share Framework', 'music, gaming', 'TaylorMadeTraffic', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End', 'The music is shared a runtime using Galaxy\'s All-Share and Chord Framework. This internal project was never completed but I still have hopes to revive it with the right team. Please reach out if you\'re interested in working together.', 'A mobile beat machine to create and share music with friends', '<em>The first mobile beat machine to create and share music with friends in real-time.</em> \n                    <p>Like most similar apps, StudioEnVivo allows customizing your keyboard with sounds and laying background tracks as you play.</p>\n                    <p>However, unlike any other app, you can play simultaneously with other friends via Bluetooth / Chord / All-Share frameworks and finally stitch together your recordings for a collaborative composition.</p>\n                    <p>As users upload their compositions to the cloud, the social aspect of sharing and comparing compositions are endless...</p>', '<ul class=\'alphalist\'>\n                            <li>$1 download ad-free version</li>\n                            <li>$5 download ad-free with offline access and cloud storage</li>\n                        </ul>', '<ul class=\'expenselist\'>\n                            <li>30% design</li>\n                            <li>70% development</li>\n                        </ul>', '<ul class=\'datelist\'>\n                           <li>6  months: mobile app site complete</li>\n                        </ul>', '<a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/studioenvivo/research/android-app-electrum-drum-machine-sampler.jpg\" data-fancybox-group=\"studioenvivo\" >\n                            <img src=\"/wwwroot/images/sites/studioenvivo/research/android-app-electrum-drum-machine-sampler_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>\n                        <a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/studioenvivo/research/android-app-drum-machine.jpg\" data-fancybox-group=\"studioenvivo\" >\n                            <img src=\"/wwwroot/images/sites/studioenvivo/research/android-app-drum-machine_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>', NULL),
(20, 'tagged', 'development', '2010-05-01', '2011-07-01', 2010, 2011, 'Known Your Numbers', '', 'http://www.healthline.com/corporate/widgets/OptumTools/index.html', 'http://www.healthline.com/corporate/widgets/OptumTools/demo.html', NULL, 'OptumHealth', 'Healthline Networks', NULL, 'Flex, ActionScript 3', 'health', 'd', '<a href=\'/team?qtfilter=Matt Sperling\'>Matt Sperling</a>: Design. <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End. <a href=\'/team?qtfilter=Steve Berley\'>Steve Berley</a>: Project Management', 'The business requirements insisted that the tool be distributable as a single self-contained file which could be easily reskinned for other brands. It was not clear if their target devices would run Java Applets, but certain they had browsers with Flash, so we used Flex and AS3.', 'A set of 30 health assessment and preparation tools developed for OptumHealth, a division of UnitedHealth Group', NULL, NULL, NULL, NULL, NULL, NULL),
(21, 'tagged', 'development', '2010-05-01', '2011-07-01', 2010, 2011, 'Munchie Madness', '', 'http://www.healthline.com/tournaments/healthy-frozen-dinners-tournament', 'http://www.healthline.com/channel/healthy-fast-food-video', NULL, 'Healthline Networks', 'Healthline Networks', NULL, 'Flex, ActionScript 3', 'health, food', 'Healthline Networks', '', 'These two links are just a few of the very interactive microsites / applications I built for Healthline\'s editorial team or sponsoring partners.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(22, 'tagged', 'development', '2009-05-01', '2009-07-01', 2009, 2009, 'Elite Wedding Locations', '', 'http://www.weddinglocation.com', 'http://www.weddinglocation.com/clientpass/index.php', NULL, 'Elite Wedding Locations', 'Noospheric LLC', NULL, 'AJAX, ActionScript 3, Flex, PHP, mySQL, JavaScript', 'analytics, marketing', 'Elite Wedding Locations, Noospheric LLC', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End. <a href=\'/team?qtfilter=Jacquas Habra\'>Jacquas Habra</a>: Project Management. <a href=\'/team?qtfilter=Kevin Kent\'>Kevin Kent</a>: Project Management. <a href=\'/team?qtfilter=James McCorkle\'>James McCorkle</a>: Project Management', 'This system included 3 levels of access with top level administrators being able to change cost values per account or property, receive notifications upon account logins, and scheduling custom reports to be email at any frequency or time span, to anyone. The system provides complete drilling capabilities on any data set for any time frame; and populates both Flex graphs and DHTML tables and charts with a single click.', 'A reporting system for advertisers to view site traffic, user inquiries on their properties, and return-on-investment figures.', NULL, NULL, NULL, NULL, NULL, NULL),
(23, 'tagged', 'development', '2009-07-01', '2009-08-01', 2009, 2009, 'Black Panther Party', '', 'http://www.blackpanther.org', 'http://bpp.taylormadetraffic.com/', NULL, 'Huey P. Newton Foundation', 'Huey P. Newton Foundation', NULL, 'ActionScript 3, PHP, CodeIgniter, mySQL, AJAX, JavaScript, CSS3, Apache', 'education, ecommerce', 'Huey P. Newton Foundation', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End, Back-End.\r\n<a href=\"/team?qtfilter=\">Hillian</a>: Product Development.\r\n<a href=\"/team?qtfilter=Justin Herman\">Justin Hermann</a>: Flash Movie Animation.\r\n', 'Eli implemented the Google Language API (php) to translate entire site and individual articles to nearly any language using an asynchronous AJAX cue-engine to control http request priorities, frequency and timeouts. Extended open source CMS OpenCart with configuration options to map and re-stylize all products and profiles', 'Design & developed a unique interface for navigating articles, essays, events, and new program initiatives. This was a volunteer project with early ambitions for a commercial joint venture. It fell apart over internal issues.', NULL, NULL, NULL, NULL, NULL, NULL),
(24, 'tagged', 'development', '2009-03-01', '2009-10-01', 2009, 2009, 'ChartMedica', '', 'http://www.chartmedica.com', NULL, NULL, 'ChartMedica LLC', 'Noospheric LLC', NULL, 'ActionScript 3, Flex, PHP, mySQL, Apache', 'health', 'ChartMedica LLC', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End. <a href=\'/team?qtfilter=Roy\'>Roy</a>: Back-End. <a href=\'/team?qtfilter=David\'>David</a>: Back-End', 'Developed Flex-based interface for a patient\'s medical records system. Extended the server-side services to generate dynamic PDF (fpdf) of records and record requests. PDFs were then automatically faxed to physician offices when 5 available incoming fax lines to parse and import records (using myFax.com API). The application also included other libraries and components such as e-signing with Flex and hospital searches by location and specialty.', 'Features included an advanced pdf viewing tool, autocompletes searching over 600K records, and automated faxing via MyFax API.', NULL, NULL, NULL, NULL, NULL, NULL),
(25, 'tagged', 'development', '2008-09-01', '2009-02-01', 2008, 2009, 'The Means', '', 'http://www.TheMeans.info', 'http://www.TheMeans.info/_dev/web40.php', '1', 'TaylorMadeTraffic', 'Berkeley High School', NULL, 'ActionScript 3, PHP, mySQL, AJAX, JavaScript, CSS3, Apache', 'education, e-learning', 'TaylorMadeTrafficTaylorMadeTraffic, Berkeley High School', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End. <a href=\'/team?qtfilter=Biko Eisen-Martin\'>Biko Eisen-Martin</a>: Product Development', 'UI Tools include tinyMCE text editor, advance sourcing maps, and multi-category search options', '<p>A vision from <a href=\"http://www.google.com.co/search?q=biko+eisen-martin\" target=\"_blank\">Biko Eisen-Martin</a> for his students at <a href=\"http://bhs.berkeleyschools.net/\" target=\"_blank\">Berkeley High School</a> to create a tool for teachers and students to collaborate and compete in the writing process. Modeled after a traditional newsroom, students and teachers would be able to develop assignments, work on multiple versions of a story, share ideas within the class, and more. \r\n                    We built a prototype site that supported a semester of great essays still worth reading, but the project lost momentum as we both moved cities.</p>\r\n                    <p>This project\'s greatest potential was in a version-controller for teachers to review, grade and provide feedback on student\'s essays, while peer reviews drove friendly competition between writer and school rankings.</p>\r\n                    <p>If you work in Education or feel something like this could help your classroom or school district, please email me. I\'d love bring it back to life in our spare time.</p>', '<em>A platform for High School newspapers that allows students to collaborate and share their academic and athletic achievements.</em>\n                <p>Students and teachers would be able to develop assignments, work on multiple versions of a story, share ideas within the class, and more.</p>            \n                <p>The competitive advantage of this site is in the version-controlling system that allows peer-reviews, teachers edit, and the student\'s versions to all be tracked independently. In addition, the system would include tools for simplifying footnotes and sources, and to include photos and links.</p>', '<ul class=\'alphalist\'>\n                            <li>License to private schools &amp; learning institutions</li>\n                            <li>Donate to the public school system, gain publicity and intimate access to the youth market, along with tax deductions from donation.</li>\n                        </ul>', '<ul class=\'expenselist\'>\n                            <li>20% design</li>\n                            <li>60% development</li>\n                            <li>20% sales & support</li>\n                        </ul>', '<ul class=\'datelist\'>\n                            <li>6 months: in 2 schools with basic text-editor and version controlling</li>\n                            <li>1 year: in schools with full-feature text-editor and multi-user version controlling</li>\n                        </ul>', '<ul class=\'competitorlist\'>\n                            <li><a href=\"http://www.schoolnewspapersonline.com/pricing/\" target=\"_blank\">SchoolNewsPaperOnline.com/pricing</a> - $600 - $3,900 USD / year</li>\n                            <li><a href=\"http://www.yourstudentnews.com/article.php?id=8\" target=\"_blank\">YourStudentNews.com</a> - $25 - $400 USD / year</li>\n                            <li><a href=\"http://www.ihigh.com/advertising/\" target=\"_blank\">iHigh.com</a> - advertising model</li>\n                            <li><a href=\"https://wikispaces.com/\" target=\"_blank\">wikispaces.com</a> - free</li>\n                            <li><a href=\"https://www.edmodo.com/\" target=\"_blank\">edmodo.com</a> - free</li>\n                            <li><a href=\"https://grockit.com/\" target=\"_blank\">grockit.com</a> standardized test preparation - $29.99/month </li>\n                        </ul>         \n                        <a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/means/research/sno.jpg\" data-fancybox-group=\"themeans\" >\n                            <img src=\"/wwwroot/images/sites/means/research/sno_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>\n                        <a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/means/research/ihigh.jpg\" data-fancybox-group=\"themeans\" >\n                            <img src=\"/wwwroot/images/sites/means/research/ihigh_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>                        \n                        <a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/means/research/ysn.jpg\" data-fancybox-group=\"themeans\" >\n                            <img src=\"/wwwroot/images/sites/means/research/ysn_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>', '<ul class=\'marketresearch\'>\n                            <li>Across the United States there are 26,407 public secondary schools and 10,693 private secondary schools (2001) - <a href=\"http://www2.ed.gov/about/offices/list/ovae/pi/hs/hsfacts.html\" target=\"_blank\">source</a></li>\n                            <li>The total 1999 fall enrollment in public secondary schools (grades 9-12) was slightly over 13,369,000 students (2001) - <a href=\"http://www2.ed.gov/about/offices/list/ovae/pi/hs/hsfacts.html\" target=\"_blank\">source</a></li>\n                            <li>There are 8,262 secondary schools in Colombia (2001) - <a href=\"http://www.bdigital.unal.edu.co/3667/15/15_Indicadores_de_Gesti%C3%B3n_los_indicadores_de_la_l%C3%ADnea_objetivo_04_D.PDF\" target=\"_blank\">source</a></li>\n                        </ul>'),
(26, 'tagged', 'development', '2009-09-01', '2010-01-01', 2009, 2010, 'MyCubi.com', '', NULL, NULL, '1', 'MyCubi', 'MyCubi', NULL, 'PHP, CodeIgniter, mySQL, Facebook Graph API, JavaScript, AJAX, CSS3, Apache', 'marketing, ecommerce', 'MyCubi', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Anatoliy Yastreb\'>Anatoliy Yastreb</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Danielle McCormick\'>Danielle McCormick</a>: Product Development. <a href=\'/team?qtfilter=Maeve Hackett\'>Maeve Hackett</a>: Product Development. <a href=\'/team?qtfilter=Will McCormick\'>Will McCormick</a>: Product Development. <a href=\'/team?qtfilter=Michael D Montoya\'>Michael D Montoya</a>: Product Development. <a href=\'/team?qtfilter=Colm Walsh\'>Colm Walsh</a>: Product Development', '<ul>\n                    <li>Wrote advanced search logic for finding and filtering results by type, distance, price, date, time and other criteria.</li>\n                    <li>Plotted all search results on a Google mapping application - by distance using the Haversine formula - with custom markers for Cubi type. Upon clicking markers expanded with tabbed windows to provide additional StreetViews, \'cubi\' details, and directions (using Google maps v2 API).</li>\n                    <li>Built Facebook application (using FBConnect) to post on user walls and send messages to friend\'s inboxes.</li>\n                    <li>Integrated and upgraded social networking \'inviter\' script to share/publish user profiles and details across a dozen email clients and two dozen social networks.</li>\n                </ul>', 'A social networking tool for connecting sellers, buyers, and services', NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'tagged', 'development', '2010-03-01', '2010-06-01', 2010, 2010, 'Planet Maple', '', 'http://pmsk8.com', NULL, '1', 'Planet Maple', 'Burst Entertainment', NULL, 'PHP, mySQL, Facebook Graph API, JavaScript, AJAX, CSS3, HTML5, Apache', 'sports, ecommerce', 'Planet Maple, Burst Entertainment', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End, Design. <a href=\'/team?qtfilter=Ajax Gokhale\'>Ajax Gokhale</a>: Front-End. <a href=\'/team?qtfilter=Ishwar Joshi\'>Ishwar Joshi</a>: Back-End. <a href=\'/team?qtfilter=Lisa Vasquez\'>Lisa Vasquez</a>: Product Development. <a href=\'/team?qtfilter=Cedric Bell\'>Cedric Bell</a>: Product Development. <a href=\'/team?qtfilter=William Lamar\'>William Lamar</a>: Product Development', 'Design & developed e-commerce platform based on CMS OpenCart with custom modules for resident skater / surfer profiles and FBConnect (depreciated)', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(28, 'tagged', 'development', '2008-04-01', '2008-08-01', 2008, 2008, 'BCBGMaxAzriaGroup', '', 'http://www.bcbgmaxazriagroup.com/Fall2009', NULL, NULL, 'BCBGMaxAzriaGroup', 'BCBGMaxAzriaGroup', NULL, 'ActionScript 2, PHP, mySQL', 'fashion', 'BCBGMaxAzriaGroup', '<a href=\'/team?qtfilter=Natasha Li\'>Natasha Li</a>: Design. <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End. <a href=\'/team?qtfilter=Robert Baindourve\'>Robert Baindourve</a>: Front-End. <a href=\'/team?qtfilter=Edwin Ado\'>Edwin Ado</a>: Back-End. <a href=\'/team?qtfilter=Ray\'>Ray</a>: Back-End. <a href=\'/team?qtfilter=Edwin Roses\'>Edwin Roses</a>: Artistic Direction', '<ul>\n                    <li>Created Fall 2008 BCBGMaxAzriaGroup company site and flash catalogue with another team member</li>\n                    <li>Built BCBG.tv to archive all video content with search and sorting capabilities. Delivered thumbnail and text descriptions of every video with content pulled from static XML, Flash Media Server, and mySQL/PHP</li>\n                    <li>Created Tell-A-Friend applications for users to email their friends products and links directly from our site</li>\n                    <li>Added client side features for saving settings and style preferences via Local Shared Objects (flash cookies)</li>\n                </ul>', 'A major overhaul of the corporate branding home', NULL, NULL, NULL, NULL, NULL, NULL),
(29, 'tagged', 'development', '2008-07-01', '2008-08-01', 2008, 2008, 'HerveLeger', '', 'http://www.herveleger.com', NULL, NULL, 'HerveLeger', 'BCBGMaxAzriaGroup', NULL, 'ActionScript 2, PHP, mySQL', 'fashion', 'HerveLegerHerveLeger, BCBGMaxAzriaGroup', '<a href=\'/team?qtfilter=Joe\'>Joe</a>: Design. <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End. <a href=\'/team?qtfilter=Edwin Ado\'>Edwin Ado</a>: Back-End', 'Developed store location profiles & finder, along with runway/fashion show video presentations', 'The highest priced brand from the BCBGMaxAzriaGroup', NULL, NULL, NULL, NULL, NULL, NULL),
(30, 'tagged', 'development', '2008-08-01', '2008-12-01', 2008, 2008, 'Building Safety Solutions', '', 'http://www.bssnet.com', NULL, NULL, 'Building Safety Solutions', 'Building Safety Solutions', NULL, 'ActionScript 2, JSFL, Scorm', 'education, e-learning', 'Building Safety Solutions', '<a href=\'/team?qtfilter=Umberto Polanco\'>Umberto Polanco</a>: 3DModeling. <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Hector Gomez\'>Hector Gomez</a>: Business Development', '<ul>           \n                <li>Integrated Building-Safety-Solution\'s (www.bssnet.com) emergency evacuation training program with Ameriprise Financial\'s Learning-Management-System (LMS). Used Flash\'s External Interface to join the interface and Scorm 1.2 LMS</li>\n                <li>Wrote a JSFL script to export, convert and organize named layers directly from Illustrator CS3 into a single Flash movie clip. A naming convention for each layer in Illustrator specified how movie clips were named and embedded within each other. This provided the core content for a standalone Flash product which I built to allow safety professionals and engineers to zoom and locate safety equipment, stairwells, sprinklers and more, on every floor, throughout multiple skyscrapers.</li>\n                </ul>', 'Commercial software providing interactive emergency evacuation training for skyscrapers and public buildings throughout the US. Advanced UI tools include detail floor maps of emergency equipment and exit routes with controls for sorting and searching', NULL, NULL, NULL, NULL, NULL, NULL),
(31, 'tagged', 'development', '2004-08-01', NULL, 2004, 2004, 'The A&E Advisor', '', NULL, NULL, NULL, 'TaylorMadeTraffic', 'TaylorMadeTraffic', NULL, 'ActionScript 3, Illustrator, Photoshop, Flash', 'education, e-learning', 'TaylorMadeTraffic', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Design, Business Development. <a href=\'/team?qtfilter=Rob\'>Rob</a>: Front-End. <a href=\'/team?qtfilter=Che Hashim\'>Che Hashim</a>: Legal Consul', 'Through predictive questioning, the tool was meant to create completely customized contracts from an intelligent questionnaire about the parties involved, their interests, and needs. Provides bi-partisan advice from attorneys, artists, and industry professionals', 'A fully interactive textbook for the Legal and Strategical Aspects of the Music Recording Industry', '<em>An e-Textbook for the Legal and Strategical Aspects of the Music Recording Industry.</em>\n                      <p>The tool would guide and prepare Artists, Concert Promoters, Event Venues, and Talent Managers through business and contract negotiations for a wide variety of agreements. </p>\n                      <p>The interactive questionnaire would include videos, podcasts, and written advice from experienced, prominent attorneys, Artists, managers, and other industry professionals.</p>', '<ul class=\'alphalist\'>\n                            <li>$50 textbook sold through music and law institutions and universities</li>\n                            <li>$10 - $50 online subscriptions.</li>\n                        </ul>', '<ul class=\'expenselist\'>\n                            <li>10% design</li>\n                            <li>40% development</li>\n                            <li>20% legal</li>\n                            <li>20% sales</li>\n                            <li>10% interviews / endorsements</li>\n                        </ul>', '<ul class=\'datelist\'>\n                           <li>1 year: mobile & site: 5 interactive, online contracts templates </li>\n                           <li>1.5 years: contract wizard engine complete</li>\n                           <li>2 years: selling in schools</li>\n                        </ul>', '<ul class=\'competitorlist\'>\n                            <li><a target=\"_blank\" href=\"https://www.nolo.com/products/joint-ownership-agreement-for-an-invention-pr272-13364.html/\">Nolo Press</a> Joint Ownership Agreement for an Invention - $34.99 USD online form and wizard</li>\n                            <li><a target=\"_blank\" href=\"https://www.nolo.com/products/intellectual-property\">Nolo Press</a> Intellectual Property Books $20 - $200.00 USD</li>\n                            <li><a target=\"_blank\" href=\"http://www.amazon.com/Best-Sellers-Books-Business-Contracts-Law/zgbs/books/10824\">Amazon\'s</a> most popular contract books - $20 - $200 USD</li>\n                            <li><a href=\'http://www.pollstarpro.com/opencontent.aspx?ArticleID=14194&id=home&source=AD\' target=\'_blank\'>Pollstar</a> subscriptions - $400 - $800 USD</li>\n                            <li><a href=\"https://www.legalzoom.com/legalforms/band-partnership-agreement\" target=\'_blank\'>LegalZoom</a> Band Partnership Agreement - $29.99 USD</li>\n                        </ul>\n                        <a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/ae/research/amazon-most-popular-contracts.jpg\" data-fancybox-group=\"themeans\" >\n                            <img src=\"/wwwroot/images/sites/ae/research/amazon-most-popular-contracts_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>\n                        <a class=\"snapshots mask0x250 fancybox\" href=\"/wwwroot/images/sites/ae/research/nolo-joint-venture-online.jpg\" data-fancybox-group=\"themeans\" >\n                            <img data-src=\"\" src=\"/wwwroot/images/sites/ae/research/nolo-joint-venture-online_400x0.jpg\" />\n                            <div class=\"blackOutFadeBG\"></div>\n                        </a>', '<ul class=\'marketresearch\'>\n                            <li><a class=\'sourceLink\' href=\"http://money.futureofmusic.org/how-many-musicians-are-there/\" target=\"_blank\">Pollstar</a> lists 10,859 touring artists, 71,823 Events</li>\n                            <li>815,000 artists self-registered on <a href=\"http://musicbrainz.org/statistics\" target=\'_blank\'>musicbrainz.org</a></li>\n                            <li><a class=\'sourceLink\' href=\"http://www.ascap.com/about/\" target=\"_blank\">ASCAP</a>: 435,000 composters, songwriters, music publishers</li>\n                            <li><a class=\'sourceLink\' href=\"http://www.bmi.com/about\" target=\"_blank\">BMI</a>: 500,000 composters, songwriters, music publishers</li>                            \n                        </ul>'),
(32, 'tagged', 'development', '2008-08-01', '2009-01-01', 2008, 2009, 'Good Life With Gabby', '', 'http://www.goodlifewithgabby.com', NULL, NULL, 'Good Life With Gabby', 'Burst Entertainment', NULL, 'ActionScript 2, PHP, CodeIgniter, mySQL, JavaScript, AJAX, Google API, CSS3, HTML5, Apache', 'kids, health', 'Good Life With Gabby, Burst Entertainment', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Unknown\'>Unknown</a>: Free-Hand. <a href=\'/team?qtfilter=Lisa Vasquez\'>Lisa Vasquez</a>: Business Development', 'Designed and developed all animation and interactivity for a kids\' website on healthy eating habits and recipes (AS2/XML/PHP: www.goodlifewithgabby.com / flash.goodlifewithgabby.com). Applications included coloring book, recipes sorter, dynamic video player, and language translator via Google Language API', 'A fun, educational site for kids and parents to learn about, and find recipes on healthy lifestyles and nutrition. Includes tooling book, jquery shopping page, recipes table, videos, and translation of virtually everything into 12 languages at runtime via Google\'s language API.', NULL, NULL, NULL, NULL, NULL, NULL);
