(33, 'tagged', 'development', '2008-05-01', '2009-06-01', 2008, 2009, 'Ruth Raser', '', 'http://www.ruthraser.com', 'http://www.ruthraser.com/newRaser.html', NULL, 'Ruth Raser', 'Ruth Raser', NULL, 'ActionScript 3, Flex', 'fashion', 'Ruth Raser', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Development', NULL, 'A unique approach to navigation, with advance controls for restyling the site\'s backgrounds, panels, and colors at runtime.', NULL, NULL, NULL, NULL, NULL, NULL),
(34, 'tagged', 'development', '2009-01-01', '2009-02-01', 2009, 2009, 'Margaret Timbrell', '', NULL, NULL, NULL, 'Margaret Timbrell', 'Margaret Timbrell', NULL, 'ActionScript 3', 'art', 'Margaret Timbrell', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Design', NULL, 'A simple and effective layout with clean animation and some customizing features', NULL, NULL, NULL, NULL, NULL, NULL),
(35, 'tagged', 'development', '2009-03-01', '2009-04-01', 2009, 2009, 'Fuse Green', '', NULL, NULL, NULL, 'Fuse Green', 'Fuse Green', NULL, 'ActionScript 3, Flash', 'art, fashion', 'Fuse Green', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Fuse Green\'>Fuse Green</a>: Design', NULL, 'A graphic designer\'s portfolio offering zooming tools on every image and easy access to every page and image at once.', NULL, NULL, NULL, NULL, NULL, NULL),
(36, 'tagged', 'development', '2004-04-01', '2006-02-01', 2004, 2006, 'Ankh Marketing', '', NULL, NULL, NULL, 'Ankh Marketing', 'Ankh Marketing', NULL, 'ActionScript 2', 'music, events', 'Ankh Marketing', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End. <a href=\'/team?qtfilter=Tommy Goodwin\'>Tommy Goodwin</a>: Project Management. <a href=\'/team?qtfilter=Kamel J Bell\'>Kamel J Bell</a>: Project Management. <a href=\'/team?qtfilter=Thomas Flannery\'>Thomas Flannery</a>: Project Management', NULL, 'A few very old flash sites and email blasts for friends and the former employer of Ankh', NULL, NULL, NULL, NULL, NULL, NULL),
(37, 'current', 'development', '2014-03-01', '2014-10-01', 2014, 2014, 'tripchi - CMS & API', 'Content Management System and API', 'http://cms.tripchi.com', 'http://cms.tripchi.com', NULL, 'tripchi', 'tripchi', NULL, 'Drupal 7, PHP, MySQL, Facebook Graph API, CSS3, HTML5, JavaScript, Apache', 'travel', 'tripchi', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Roberto Golan\'>Roberto Galan</a>: Design. <a href=\'/team?qtfilter=Chandra Jacobs\'>Chandra Jacobs</a>: Project Management &amp; Business Development ', '<ul>\n<li>Built OAuth2, token secured CMS & API with Drupal 7</li>\n<li>Hooked Drupal Views to set default filters based users\' profiles, location, next flight information. </li>\n<li>Integrated FlightStats API at runtime while adding or editing flight information.</li>\n<li>Optimized site and API with CRON jobs to update flight status and real time airport details from FlightStats API</li>\n</ul>', 'Your passport to explore the airport. Discover restaurants, shopping, deals, unlock airport secrets & more.​', '', NULL, NULL, NULL, NULL, NULL),
(39, 'tagged', 'development', '2014-09-01', '2015-02-01', 2014, 2015, 'Cultur', '', 'http://www.cultur.io', 'http://www.cultur.io/app.html', NULL, 'Cultur LLC', 'Cultur LLC', NULL, 'Ruby on Rails, mySQL, AJAX, JavaScript, jQuery Mobile, Facebook Graph API, MapBox', 'music, events', 'Cultur LLC', '<a href=\'/team?qtfilter=Kaili Miyamoto\'>Kaili Miyamoto</a>: Design. <a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End. <a href=\'/team?qtfilter=Rama Mcintosh\'>Rama Mcintosh</a>: Back-End. <a href=\'/team?qtfilter=Caleb Haye\'>Caleb Haye</a>: Back-End. <a href=\'/team?qtfilter=Jan Uetz Ayacaba Ondo\'>Jan Uetz Ayacaba Ondo</a>: Business Development. <a href=\'/team?qtfilter=Jonny Mack\'>Jonny Mack</a>: Business Development. <a href=\'/team?qtfilter=Mike Hegazy\'>Mike Hegazy</a>: Business Development', 'Cultur has a simple jquery mobile interface for navigating events crawled by a Ruby on Rails crawler\n                </ul>', 'Cultur is your Ultimate Event Resource, to get what you need when you want it. Find any activity/event going on around you at any time and any place. See if your friends or people with like interests will be there.', NULL, NULL, NULL, NULL, NULL, NULL),
(40, 'current', 'development', '2015-11-01', '2016-04-01', 2015, 2016, 'Blingby', 'Live the Experience', 'http://blingby.com', NULL, NULL, 'Blingby LLC', 'Blingby LLC', NULL, 'Drupal 7, PHP, MySQL, CSS3, HTML5, JavaScript, YouTube API, Google Maps API, AJAX, Apache', 'travel, music, fashion, marketing', 'Blingby LLC', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Robert Stanicic\'>Robert Stanicic</a>: Business Development', '<ul>\n<li>Configured and hooked Drupal Views to query content internally and from Amazon for album artwork as well as YouTube for matching videos.</li>\n<li>Rebuilt Drupal templates for a more responsive experience across devices with CSS3</li>\n<li>Developed google-map interface and query logic to re-order of ad / affiliates\' links based on the user\'s location and affiliates’ geographic settings.</li><li>Built several administrative tools for configuring home page settings, photo carousels, and reviewing data-integrity from error logs and Drupal’s url_alias table.</li> \n</ul>', 'Blingby lets users \'live the experience\' of their favorite music videos and movie trailers. Blingby LLC tags top-voted YouTube videos with purchase links so products, hotels, and artists are shown in-sync as the video plays.', '', NULL, NULL, NULL, NULL, NULL),
(41, 'current', 'development', '2014-10-01', '2015-10-01', 2014, 2015, 'tripchi - Auto Importer & Taxonomy Builder', 'HTML Scraper & Importer with Automated Taxonomy Builder', 'https://cms.tripchi.com/admin/tripchi/bg/import', 'https://cms.tripchi.com/admin/tripchi/bg/import', NULL, 'tripchi', 'tripchi', NULL, 'Drupal 7, PHP, MySQL, HTML5, CSS3, JavaScript, Apache', 'travel, language, analytics', 'tripchi', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End', '<ul>\n<li>Developed scraper tool for importing Airport data from HTML, JSON, and RSS feeds.</li>\n<li>Automated and improved categorization - despite an insufficient taxonomy - by learning from the full text of previous imports.</li>\n<li>Built batch processing tool to review and update importer decisions by tagging content to effect Tag weights to a primary Type.</li>\n</ul>', 'Tags map many-to-many and are used by the global search box, Types map 1-to-many and are used by the main drawer menu\'s selectable filters.', NULL, NULL, NULL, NULL, NULL, NULL),
(42, 'current', 'development', '2014-03-01', '2015-10-01', 2014, 2015, 'tripchi - Native Mobile App', 'Native Android Mobile Application', 'https://m.tripchi.com', 'https://m.tripchi.com', NULL, 'tripchi', 'tripchi', NULL, 'Cordova, Phonegap, Node.js, HTML5, CSS3, JavaScript, jQuery Mobile, Google Maps API, Facebook Graph API, Google Anayltics API', 'travel', 'tripchi', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End. <a href=\'/team?qtfilter=Roberto Golan\'>Roberto Galan</a>: Design. <a href=\'/team?qtfilter=Chandra Jacobs\'>Chandra Jacobs</a>: Project Management &amp; Business Development ', '<ul>\n<li>Built a fluid interface, fully responsive from 320 to 1024+ pixels wide, without a page refresh, with HTML5 and CSS3</li>\n<li>Scripted all API integrations with JavaScript / jQuery, parsing HTML and JSON from the Drupal server and across domains and third-party web services.</li>\n<li>Deployed the mobile application through Cordova and Node.js plugins to quickly configure, compress, and compile the Android APK.</li>\n</ul>', 'A content manager and mobile app to guide users through airports and find flight, safety, and consumer information; as well as share rides to common destinations to and from the airport', NULL, NULL, NULL, NULL, NULL, NULL),
(44, 'tagged', 'development', '2016-01-01', '2016-06-01', 2016, 2016, 'Track Authority - Native Mobile App', '', 'https://play.google.com/store/apps/details?id=com.trackauthoritymusic.com', 'https://itunes.apple.com/us/app/track-authority-music/id1148706218', NULL, 'TaylorMadeTraffic', 'Track Authority Music', '', 'Cordova, Phonegap, Node.js, HTML5, CSS3, JavaScript, Facebook Graph API, Google Analytics API', 'music, events, gaming', 'TaylorMadeTraffic, Track Authority Music', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End, Business Development', '<ul>\n<li>Built a fluid interface, fully responsive from 320 to 1024+ pixels wide, without a page refresh, with HTML5 and CSS3</li>\n<li>Scripted all API integrations with JavaScript and PHP.</li>\n<li>Deployed the mobile application through Cordova and Node.js plugins to quickly configure, compress, and compile mobile applications for Android and iOS.</li>\n</ul>', 'A platform for perfecting playlists and parties by awarding musical tastes', NULL, NULL, NULL, NULL, NULL, NULL),
(45, 'tagged', 'development', '2016-07-01', '2016-07-20', 2016, 2016, 'Track Authority - Angular Player', '', NULL, 'https://player.trackauthoritymusic.com', NULL, 'TaylorMadeTraffic', 'Track Authority Music', NULL, 'AngularJS, Node.js, HTML5, CSS3, Less, YouTube API', 'music, events, gaming', 'TaylorMadeTraffic, Track Authority Music', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End, Business Development', 'An AngularJS music & YouTube player that helps build playlists against Track Authority challenges by searching YouTube for related titles. This new interface is an entirely separate codebase slowly being integrated with CodeIgnitor / API features', 'A music/youtube player to help users build playlists around Track Authority challenges', NULL, NULL, NULL, NULL, NULL, NULL),
(46, 'current', 'development', '2017-08-01', '2020-01-01', 2017, 2019, 'FLC', 'Federal Laboratory Consortium for Technology Transfer', 'https://www.federallabs.org', NULL, NULL, 'Federal Labs Consortium', 'Cypher LLC', NULL, 'PHP, Drupal 7, mySQL, Apache, Google Maps API, HTML5, CSS3, Sass, Bootstrap', 'technology, marketing, events, analytics', 'Federal Laboratory Consortium, Cypher LLC, UTRS', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End, Back-End, API. <a href=\"/team?qtfilter=Joseph Anderson\">Joseph Anderson</a>: Cypher CEO. <a href=\"/team?qtfilter=Denise Wainer\">Denise Wainer</a>: UTRS Director of Communications. <a href=\"/team?qtfilter=Will Dyson\">Will Dyson</a>: UTRS System Administrator, Release', '<ul>\n  <li>Programmtically migrated a custom Solr server into Drupal for content management</li>\n  <li>Wrote duplicate reducer to compare nodes by measuring the similarity of common fields across sources. Used Levenshtein Distance algorithm and took action based on threshold configurations.</li>\n  <li>Rebuilt new Solr indexes with Drupal\'s Search API to respect CMS revisions and publish settings</li>\n  <li>Built Full-Text search tools for the global site <a href=\"https://www.federallabs.org/search\" target=\"_blank\">Search</a> and <a href=\"https://www.federallabs.org/flcbusiness\" target=\"_blank\">FLCBusiness</a></li>\n  <li>Built custom in-page editorial tools available by Drupal roles and node access hooks</li>\n  <li>Integrated CAS Authentication System for unified login portal between FLC sites</li>\n  <li>Rebuilt custom theme with Bootstrap 4 to improve overall site responsiveness, scalability, and ARIA compliance</li>\n  <li>Wrote automated crawling importers for all NASA labs and various 3 parties technology sources</li>\n  <li>Upgraded Google Map integration to automatically update Map results alongside listed search results</li>\n</ul>\n', 'Promoting, Educating, and Facilitating Knowledge Transfer', NULL, NULL, NULL, NULL, NULL, NULL),
(47, 'current', 'development', '2017-12-01', '2018-12-01', 2017, 2018, 'Refined Motion', NULL, NULL, 'http://flexassembly.taylormadetraffic.com/radialarm/index.html?useMouse=true', NULL, 'Refined Motion', 'Flexible Assembly Systems', NULL, 'Node-Red, Node.js, JavaScript, CSS3, HTML5, ReactJS, Express.js, Bootstrap, WebSockets', 'technology, robotics, manufacturing', 'Refined Motion, Tesla Motors, Flexible Assembly Systems Inc.', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End, Back-End. <a href=\"/team?qtfilter=Aaron Silverberg\">Aaron Silverberg</a>: Vice President', '<ul>\n  <li>Built interface to configure assembly jobs and control machinary over WebSockets</li>\n  <li>Structured interface for offline-first activity, allowing jobs to continue manually but still presenting screw order and tracking process in Local Storage.</li>\n  <li>Built client-side performance tracker averaging the time to assemble one project in a job</li>\n  <li>Created custom node-red nodes for smoother synchronization with Fanuc robots</li>\n  <li>Wrote strict data validation to check torque and resistance values after each fastener, stored value in remote mySQL database, and only preceed on passes</li>\n</ul>\n', 'Assembling line job builder and monitoring', NULL, NULL, NULL, NULL, NULL, NULL),
(48, 'tagged', 'development', '2017-09-01', '2018-02-01', 2017, 2018, 'Ampp Star', 'Art, Music, Poetry, & Photography', 'http://www.amppstar.com/', NULL, NULL, 'Ampp Star', 'Ampp Star', NULL, 'ReactJS, MongoDB, Node.js, Express.js, KeystoneJS, HTML5, CSS3, Sass, Bootstrap', 'music, art', 'Ampp Star', '<a href=\"/team?qtfilter=E.A.Taylor\" >E.A.Taylor</a>: Front-End, Back-End.\n<a href=\"/team?qtfilter=Jahanzaib Aslam\" >Jahanzaib Aslam</a>: Front-End, Back-End.\n<a href=\"/team?qtfilter=Garrett Morris\" >Garrett Morris</a>: Front-End, Back-End.\n<a href=\"/team?qtfilter=Bisera Mandic\" >Bisera Mandic</a>: Owner', '<ul>\n  <li>Built React.js application with Keystone.js CMS, MongoDB database and Express server. </li>\n  <li>Connected Express API on Heroku with S3 bucket for user file storage</li>\n  <li>Connected Mailgun and Nodemail services within application and Heroku control panels for automated emails</li>\n</ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(49, 'current', 'development', '2018-05-01', '2018-12-31', 2018, 2018, 'Imagerie', 'A TensorFlow training interface', NULL, 'http://imagerie.taylormadetraffic.com/training/demo', NULL, 'Flexible Assembly Systems', 'Flexible Assembly Systems', NULL, 'Node.js, Express.js, ReactJS, Bootstrap, AWS S3, Docker, Webpack 4, TensorFlow, Kubernetes, Google Cloud Platform', 'technology, analytics, robotics, manufacturing', 'Refined Motion, Flexible Assembly Systems Inc.', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End.\n   <a href=\"/team?qtfilter=Sam Silverberg\">Sam Silverberg</a>: TensorFlow.\n   <a href=\"/team?qtfilter=Aaron Silverberg\">Aaron Silverberg</a>: Product Development.', '<ul>\n    <li>Built interface and middleware components to robust automated image training program</li> \n    <li>Express Server as proxy service to upload / download photos from Minio / AWS S3 and other storage services</li>\n    <li>Drop and Drop photo library manager for building trainings from remote and local photos</li>\n    <li>Customized Tree component for infinite nesting of tags under photos, and easier review of tag and photo collections with counts and average region sizes</li>\n    <li>Customized drawing component for creating, dragging, and resizing tags with 0 - 400% magnified zoom window</li>\n    <li>User defined categories, tag names, and tool sets</li>\n    <li>Automated demo builder with <a target=\"_blank\" href=\"http://imagerie.taylormadetraffic.com/training/demo?photo-count=500\">customizing parameters</a></li>\n    <li>Webpack 4 hotloading development environment with testing, production and development build scripts for packing and deployment</li>\n  </ul>', 'Automate quality assurance with image detection', NULL, NULL, NULL, NULL, NULL, NULL),
(50, 'current', 'development', '2020-01-01', '2021-01-01', 2020, 2021, 'Track Authority Music', 'Rewarding Musical Tastes', 'https://trackauthoritymusic.com', '', NULL, 'Taylor Made Traffic', 'Track Authority Music', NULL, 'ReactJS, Material-UI, Drupal 8, mySQL, Apache, Youtube API, WebVTT', 'music, events, gaming', 'TaylorMadeTraffic, Track Authority Music', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End, Business Development', '<h3>Built all aspects of ReactJS responsive web app with Redux and Material-UI</h3>\r\n<ul>\r\n    <li>Built single codebase to compile different applications with unique branding, themes and functionality. For examples, see\r\n        <ul>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://fantasytrackball.com\" target=\"_blank\">therapruler.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://fantasytrackball.com\" target=\"_blank\">fantasytrackball.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://jetsetlovers.com\" target=\"_blank\">jetsetlovers.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://thebeatbazaar.com/\" target=\"_blank\">thebeatbazaar.com</a>\r\n            </li>\r\n            <li style=\"margin-top: 0;list-style: initial;\"><a href=\"https://rsoundtrack.com/est\" target=\"_blank\">rsoundtrack.com/est</a>\r\n            </li>\r\n        </ul>\r\n    </li>\r\n    <li>Wrote abstract form builder to render any layout and set of field components.</li>\r\n    <li>Wrote Cypress.io Test Suite using TypeScript and NodeJS to generate unique end-to-end tests for each brand, each with 3 device sizes. Also wrote FFMpeg script to crop and repurpose Cypress recordings as HowTo / demo videos.</li>\r\n    <li>Designed and copywrote entire application, icons and logo, sometimes in California, sometimes abroad</li>\r\n</ul>\r\n\r\n<h3>Built all aspects API and CMS from a decoupled Drupal 8 architecture with mySQL</h3>\r\n<ul>\r\n    <li>API built with PHP around Drupal 9 and Symfony, leveraging the Cache API and dependency injection for\r\n        services, query factory, and entity normalizers.\r\n    </li>\r\n    <li>Built CRUD routing paths dynamically from registered Entities and entity bundles</li>\r\n    <li>Built end-to-end functional testing suite to test all endpoints over CURL requests</li>\r\n    <li>Integrated Cloud9 Gateway alongside Commerce Funds to process transactions and keep records of users \'wallet\' value</li>\r\n    <li>Wrote OAuth2 Authentication system to issue short and long term access token from the Password Grant via HTTP and encrypted OTP links</li>\r\n    <li>Wrote Email Blast tools for Group owners to send OTP links to existing and new users safely and securely.</li>\r\n</ul>', 'Crowdsourced Communal Playlists. Rewarding Musical Tastes.', NULL, NULL, NULL, NULL, NULL, NULL),
(51, 'tagged', 'development', '2019-12-01', '2020-02-01', 2020, 2021, 'FunGiving', NULL, 'https://www.fungiving.net', NULL, NULL, 'Neha Kotecha', 'Neha Kotecha', NULL, 'React Native, MongoDB, ExpressJS, KeystoneJS', 'travel', 'Neha Kotecha', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End.\n<a href=\'/team?qtfilter=Neha Kotecha\'>Neha Kotecha</a>: Product Development.\n<a href=\'/team?qtfilter=Sammie Khalil Taylor\'>Sammie Khalil Taylor</a>: UX Design.', '<ul>\n  <li>Built ios and android apps with React Native</li>\n  <li>Used `react-native-push-notification` for push notifications</li>\n  <li>Built backend with ExpressJS and Mongo, providing both API and KeystoneJS CMS</li>\n  <li>Implemented OAuth2 Authentication with OTP logins / password resets</li>\n  <li>Wrote push notification service and cronjob to reduce push noticications and processing</li>\n</ul>', 'This app is intended to bring the community together through fulfilling the wishes of our homeless community members. Within the app, there are two users: The Santa and The Elf.', NULL, NULL, NULL, NULL, NULL, NULL),
(52, 'tagged', 'development', '2020-01-01', '2020-01-01', 2020, 2020, 'Ruhral Farms', 'Collaborative Workspaces', 'https://ruhralfarms.com/', 'https://ruhralfarms.com/red-dirt-coworkers', '', 'General Public License (GNU)', 'Ruhral Farms LLC', NULL, 'ReactJS, Redux, Bootstrap 4, Drupal 8', 'travel, health, education, technology', 'Ruhral Farms LLC', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Front-End, Back-End.\n<a href=\'/team?qtfilter=Sammie Khalil Taylor\'>Sammie Khalil Taylor</a>: UX Design', '<ul><li>Built interactive incubator application for making cooperative investments with Hawaii youth: https://ruhralfarms.com/red-dirt-coworkers</li></ul>', '', NULL, NULL, NULL, NULL, NULL, NULL),
(53, 'current', 'development', '2020-04-01', '2020-08-01', 2020, 2021, 'WBAT', 'WBAT', 'https://www.wbatsafety.com/', 'https://www.wbatsafety.com/', NULL, 'Cypher LLC', 'Cypher LLC', NULL, 'React Native, Redux, ReactJS, Google Chart API', 'safety, analytics', 'Cypher LLC, UTRS', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End, Back-End, API.\n<a href=\"/team?qtfilter=Joseph Anderson\">Joseph Anderson</a>: Cypher CEO.\n<a href=\"/team?qtfilter=Arend van der Veen\">Arend van der Veen</a>: Back-end.', '<ul>\n<li>Used React Native, Redux and AsyncStorage to create offline-first native applications for iOS and Android with persistent storage and network detection for gracefully handling session restores and database synchronization. </li>\n\n<li>Preserved backward compatibility while adding and improving all features of the app including Messaging, Safety Notifications, document sharing and downloads, file uploads.</li>\n\n<li>Built synchronous test suite for end-to-end API testing as any user.</li>\n\n<li>Used ReactJS with Google Chart API to build a variety of analytical charts on flight data with user controls for drilling on data and changing graph types.</li>\n</ul>', '', NULL, NULL, NULL, NULL, NULL, NULL),
(54, 'tagged', 'development', '2020-11-01', '2021-05-31', 2021, 2021, 'DemocraSee', 'Incentivizing Civic Action', 'https://democraseeclub.web.app/', 'https://github.com/eliataylor/clock-agendas', NULL, 'General Public License (GNU)', 'Democrasee', NULL, 'React Native, Redux, Firebase, WebRTC\n', 'events, education, e-learning', 'Democrasee', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End, Back-End.\n<a href=\"/team?qtfilter=Polina Tolkacheva\">Polina Tolkacheva</a>: UX, Design, Wordpress development.\n<a href=\"/team?qtfilter=Indy Rishi Singh\">Indy Rishi Singh</a>: Business Development.\n<a href=\"/team?qtfilter=Marcela Denniston\">Marcela Denniston</a>: Business Development', 'Combined ReactJS, Redux, RTCPeerConnection, and Firebase for screen/video/mic sharing between multiple devices.', 'An evolving idea around \"incentivizing civic action\"', NULL, NULL, NULL, NULL, NULL, NULL),
(55, 'tagged', 'development', '2020-11-01', NULL, 2020, 2020, 'DemocraSee WP Rest API', 'Incentivizing Civic Action', 'https://github.com/eliataylor/democrasee-wp', 'https://github.com/eliataylor/democrasee-wp', NULL, 'General Public License (GNU)', 'Democrasee', NULL, 'Wordpress 4, PHP', 'events, education, e-learning', 'Democrasee', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End, Back-End.\n<a href=\"/team?qtfilter=Polina Tolkacheva\">Polina Tolkacheva</a>: UX, Design, Wordpress development.', 'An unrealized effort to validate WP Rest API and the WP Gutenberg editor from the same rules, driven by field config files in https://github.com/eliataylor/democrasee-wp/tree/main/web/wp-content/plugins/democrasee/src/FieldConfigs ', 'An evolving idea around \"incentivizing civic action\"', NULL, NULL, NULL, NULL, NULL, NULL),
(56, 'current', 'development', '2021-03-01', '2021-12-31', 2021, 2021, 'Cosmo', 'Bringing order to Cyber Operations', 'https://cosmodefense.com/docs', '', NULL, 'Cypher LLC', 'Cypher LLC', NULL, 'ReactJS, GraphQL, ElasticSearch, Redis, RabbitMQ, Minio, Docker, Google Cloud Platform, Python, NodeJS, Antlr4', 'cyber security', 'Cypher LLC, UTRS', '<a href=\"/team?qtfilter=E.A.Taylor\">E.A.Taylor</a>: Front-End, Back-End.\n<a href=\"/team?qtfilter=Ray Allen\">Ray Allen</a>: Product Development.\n<a href=\"/team?qtfilter=Joseph Anderson\">Joseph Anderson</a>: Business Development.\n', '<ul>\r\n    <li>\r\n        Wrote all parsers for transforming emails and various log formats into appropriate STIX2 objects\r\n    </li>\r\n    <li>\r\n        Built customizable log ingestion system with basic runtime threat analysis to score and store relevant meta data as Stix2 objects while preserving context and source maps.\r\n    </li>\r\n    <li>\r\n        Used Stix2 ANTLR4 grammar for pattern matching log data with existing Indicators of Compromise (IoC)\r\n    </li>\r\n    <li>\r\n        Used ZAP Security Scanner to pen test company domains with attack IDs in request headers. Then wrote generic IoC Patterns based on signatures seen in logs during pen test.\r\n    </li>\r\n    <li>\r\n        Wrote Opinions API to allow analysts to score IoCs by \'vulnerability\' and \'severity\' scales separately.\r\n    </li>\r\n    <li>Built atop OpenCTI interface to follow streamlined workflow to control ingestion, triage alerts and fine tune ML\r\n        engine analysis\r\n    </li>\r\n</ul>\r\n', 'A cyber threat intelligence platform built with the cyber planner in mind. ', NULL, NULL, NULL, NULL, NULL, NULL),
(57, 'current', 'development', '2022-04-01', '2023-04-01', 2022, 2023, 'PickupMVP', 'Play & reward yourself, your community, & all athletes in any sport.', 'https://pickupmvp.com', '', NULL, 'Taylor Made Traffic', 'Track Authority Music', NULL, 'ReactJS, Material-UI, Drupal 9, mySQL, Apache, Youtube API, Flutter, Python, Darknet, Google Cloud Platform', 'music, sports, events', 'TaylorMadeTraffic, Track Authority Music', '<a href=\'/team?qtfilter=E.A.Taylor\'>E.A.Taylor</a>: Design, Front-End, Back-End, Business Development', '<div class=\"technotes\"><h3>Built front-end, backend, and AI for PickupMVP.com</h3>\r\n        <ul>\r\n            <li>Trained a neural net model for detecting balls, Players, and goals in video recordings of 4 different sports</li>\r\n            <li>Wrote all business logic for Object Tracking and isolating the clip\'s subject athlete and ball</li>\r\n            <li>Wrote abstractions for Track Authority Music (TAM) to support Groups within Groups while inheriting\r\n                publish and privacy settings from parent group\r\n            </li>\r\n            <li>Added customized Checkout process to require Release of Liability agreement</li>\r\n            <li>Extended e-commerce system to allow draft orders and entrance fee payments of upcoming matches</li>\r\n            <li>Enhanced TAM permissions matrix to allow connecting music playlists from other groups as background\r\n                music for upcoming match.\r\n            </li>\r\n            <li>Built Flutter WebView wrapper to publish as mobile app in App Store and Google Play</li>\r\n            <li>Built predictions review and feedback interface to allow additional tagging and fine tuning</li>\r\n            <li>Configured all server architecture to store clips on a mounted disk outside the runtime VM</li>\r\n        </ul>\r\n    </div>', 'A web and mobile application to find, create, promote and win rewards from live sports matches. Available in the \r\n\r\n<a target=\"_blank\" href=\"https://apps.apple.com/app/pickupmvp/id6447146796\">App Store</a> &amp;  \r\n\r\n<a target=\"_blank\" href=\"https://play.google.com/store/apps/details?id=com.pickupmvp\">Google Play</a>', NULL, NULL, NULL, NULL, NULL, NULL);
